bno_random_0001.title: "로딩 에서의 잡음" # AI Tags
bno_random_0001.desc: "조현은 성의 무더운 홀들을 돌아다니면서 당신의 땅을 정복합니다. 어두운 밤은 빠르게 촛불을 필요하게 합니다. 밤새 방으로 가는 동안, 어마어마한 소음과 소음이 들릴 수 있고, 그 다음에는 꽤나 큰 울음소리가 들리는데, 그 목소리가 빠르게 질식한다.\n\n 누가 곤경에 처해 있어? 당신은 자신을 방어할 수 없습니다, 다른 사람을 말할 것도 없습니다, 하지만 당신의 본능이 당신을 인도합니다.\n\n 공기 공기는 두꺼워지고, 아드레날린이 몸으로 튀어나오면서 [target2.GetFirstName].\n\n 들여다보면 큰 암울한 인물을 발견할 수 있습니다. 작은 흰색 몸 위에 굽혀서 허벅지를 부딪히고\n\n 얼굴이 빨강해져서 [target1.GetFirstName] 그의 거대한 블랙 샤프트를 [target2.GetFirstName] 그 반짝이는 고기를 다시 찔러서" # AI Tags
bno_random_0001.a: "내가 직접 만질 필요가 있어..." # AI Tags
bno_random_0001.b: "어쩌면 한 명 더 있을 수 있겠지?" # AI Tags
bno_random_0001.c: "이건 미친 짓이야 경비원!" # AI Tags

bno_random_1001.title: "관중의 잡음: 감시" # AI Tags
bno_random_1001.desc: "문에 기울어, 당신은 인내심을 가지고, 두 궁정관들이 순진하게 얽혀있는 것을 지켜보고 있습니다.\n\n"젠장, 젠장에서, 계속 가세요[target2.GetFirstName] 거의 노래하는 목소리로 말했습니다. 그녀의 발가락이 고, 다리가 어두운 남자의 몸을 둘러싸고 있었습니다.\n\n"좆같은 여인이네[target1.GetFirstName] 삐걱거리고, 방에서 나오는 달콤한 궁중의 삐삐와 울음소리처럼 정신없이, 당신의 손은 이미 당신의 드레스를 들어 올랐고, 두 개의 섬세한 숫자가 당신의 접구에서 작동하고, 은 이미 옆으로 밀어.\n\n"" 이 똥을 구부짖으세요. 그는 다시 짖습니다, 소녀의 작은 삐삐 소리, 그녀가 질식당하고 있다는 것을 깨닫기 전에, 그녀의 취약한 목을 둘러싼 석탄의 손을 거의 볼 수 없습니다. 당신의 마음은 화려한 속에서 흐려지고, 당신의 성추가 당신의 욕망의 무게를 받는 것을 기쁨으로 보고 있습니다. 당신이 들을 수 있는 모든 것은[target2.GetFirstName] 그녀의 몸이 굴복하고, 다리가 그녀의 손잡이를 강화하고,\n\n 거의 그녀와 조화를 이루고, 당신은 그 선두를 따르고, 당신의 다리가 조용한 울음 사이에 떨고, 내 thighs 당신의 기쁨으로 칠.\n\n 가혹한 크랙크! 두 사람이 짝짓기를 하는 것을 보고, [target1.GetFirstName] 아직도 뇌를 벌이고 있어요." # AI Tags
bno_random_1001.a: "젠장 어떻게 이렇게..." # AI Tags
bno_random_1001.b: "- 그래... 계속해" # AI Tags
bno_random_1001.c: "젠장! 아니, 아니! 왜 그냥 었지?" # AI Tags

bno_random_2001.title: "로딩 에서의 잡음: 참여" # AI Tags
bno_random_2001.desc: "당신 의 결정 이 결정 된 상태 에서, 당신 의 출석 이 즉시 알려질 것 을 기대 함 으로 문 을 열어 놓습니다. 대신, 당신의 코는 즉시 섹스의 냄새로 공격되며, 양쪽이 침대에 얽매일 때까지 착용하고 있던 버려진 옷들을 발견합니다. 당신은 삼키고, 문을 기 전에, 두 세트의 머리가 빠르게 회전, [target1.GetFirstName] 심지어는 가죽을 꺼내서 [target2.GetFirstName].\n\n"하지만, 입술에 작은 미소로, 당신은 듀오에게 악수합니다. 문이 열려있어요"\n\n 두 사람은 서로 잠시 눈을 주고받습니다. [target1.GetFirstName] "고통스러우면서 자신의 창녀로부터 해방되면서, 그녀의 가난한 똥이 조용히 그를 위해 간구합니다. 아가씨, 그녀는 손을 잡고 그의 팔을 가로지르며, 아프리카 수컷이 일어나자마자, 그의 완전히 세게 된 이 이제 당신의 즐거움을 위해 흔들리고 있습니다. 당신의 눈은 그것에 붙어 있고, 옆에서 옆으로 흔들리는 것을 보고,[target2.GetFirstName] 손의 크기와 쉽게 일치하는 수분입니다.\n\n"그의 손바닥은 당신의 쪽으로 뻗어 있습니다. 그의 입술에 미소를 짓는 미소, 여전히 조금 니다. 그는 웃고, 뒤에 문을 닫고, '피출'의 모든 기회를 침묵시킵니다. 그의 손은 당신의 몸을 잠시 돌아다니고, 당신의 몸을 끌기 시작하기 전에 드레스를 입고, 옷을 벗는 데 도움이 되죠."\n\n"뭐, [ROOT.Char.GetFirstName] "그는 말 그대로 교수형에 처해있다는 것을 몰랐나요?[target2.GetFirstName] 목소리가 울려 퍼져요. 지금 침대에 앉아 있고, 한 손이 다리 사이에 놀고 있습니다. 그녀의 연인은 당신을 벗고 그 유연한 가슴을 벗고 즉시 만지고 있는 시간을 낭비하지 않습니다.\n\n"오, 내가 네 인생의 시간을 줄게. " 그는 그 억양된 목소리로 부풀어 오고, 거의 너를 녹여버린다." # AI Tags
bno_random_2001.a: "이것이 당신의 밤의 시작일 뿐이라고 합시다." # AI Tags

bno_random_0002.title: "가족 의 문제" # AI Tags
bno_random_0002.desc: "어깨가 긴장하고, 발가락이 막강한 성의 통곡곡을 밟고, 다른 곳에는 침묵이 있습니다. 긴장감은 몸을 빼앗고, 배가 나비로 부풀고, 손을 잡고, 보석으로 놀고 있습니다. 가장 좋은 빨간색 드레스를 입고, 당신은 자신의 옷장에서 선물을 요청하고 어머니에게 다가가는 것을 목표로합니다.\n\n 그녀의 방에 도착하면 깊은 숨을 쉴 수 있습니다. 그리고 부드럽게 문을 두드리기 전에, 손목이 나무에 부딪히고 있습니다.\n\n 아무런 반응도 없이, 당신은 다른 쪽에서 오는 미묘하고 리듬적인 'THUMP THUMP ThUMP'를 감지하기 전에 숨쉬습니다. 손잡이를 휘두르며 문을 열면 상상도 못했던 광경에 쉽게 노출됩니다. [target1.GetFirstName], 왕실의 존경받는 멤버, 당신의 어머니의 결혼을 해치고, 그의 엉덩이를 그녀의 뚱뚱한 엉덩이에 고, 원시적인 욕망으로 빠져나가고 있습니다.\n\n"예, 예... 이봐, 좆같은 창녀야. 그놈은 울고, 눈치채고, 그녀의 사랑에서 나오는 젖은 을 보고, 무기력한 그의 무력한 손이 올라와, 그녀의 엉덩이에 강제로 내려와."\n\n" CRRAC" K!\n\n"신이여! 신여! 젠장! FUCCKKKK!!!" # AI Tags
bno_random_0002.a: "이건 너무 불쾌한 일이야" # AI Tags
bno_random_0002.b: "어머님!!! 잠깐, 그녀가 날 봤어?" # AI Tags
bno_random_0002.c: "무슨..." # AI Tags

bno_random_1002.title: "가족 의 문제: 감시" # AI Tags
bno_random_1002.desc: "바로 그 순간, 그녀의 보석을 깨는 데의 변명을 찾으려고 노력하는 것은 당신의 마음에서 벗어났습니다. 네 어머니의 행복은 네 시선을 삼켰고, 그 분홍색 입술이 찢어지고, 강하고 탄소색의 남자가 침략하는 것을 지켜봤다. 그의 엉덩이는 잘리지 않았는데, 당신이 익숙한 것과는 전혀 다른데, 그의 공은 당신의 이전 파트너보다 두 배 더 크죠. 올라와 내려 뛰어다니는 것은 거의 어마어마한 환각이었습니다. 네 엄마의 귀여운 작은 삐걱거리는 것은 그 남자를 끝으로 가까워뜨리는 데 도움이 되었습니다.\n\n"어젠장! 젠장 [target1.GetFirstName] 이봐요! 계속 가세요! Kno-Kn-Knock me up!" 늙은 여인은 호랑이와 아기 열에 의해 압도, 불평. 그녀의 나이에도 불구하고, 그의 둘레는 여전히 그녀의 똥을 뻗어 내기 위해 충분합니다, 마지막 시간에 잠겨서 작업을 완료합니다. 놀랍게도, 당신은 그냥 아가페 입으로 서 있습니다.\n\n 서서히, 그는 고개를 끄덕여서, 당신의 어머니의 가슴에 가벼운 박수를 던지고, 이미 그의 남성 씨앗을 저장했습니다. 그 초콜릿 똥을 바라보는 대신, 당신의 '죄 없는' 눈은 그 여자의 틈으로 끌리고, 껍질이 고 있는 흰색 정액의 덩어리를 뱉는다. 너무... 화려한 곳이죠\n\n 또 다른 신발이 통로를 가로지르는 소리를 듣고, 당신은 빨리 문을 끌고 문을 닫고, 가능한 한 신중하게 행동하고, 소스키 사건을 숨기려고 노력합니다. 자신을 구성하고, 당신은 도망치고, 즉시 앞으로 나아가고, 엄마와 함께하는 관객이 그렇게 중요하지 않다고 생각하게 됩니다." # AI Tags
bno_random_1002.a: "하지만 그 모든 거..." # AI Tags

bno_random_2002.title: "가족 의 문제: 잡혔습니다" # AI Tags
bno_random_2002.desc1: "드레스에 몇 줄이 묶여 있는 걸 풀고, 당신은 당신의 매력에 대한 수용이 흑인의 날을 만드는 열쇠라는 것을 알고 있었다. 에 웃고, 입술이 빨라지고, 문으로 걸어다니고, 틈이 조금 드러나고, 얼굴에 필요한 표정이 그려져 있습니다.\n\n 처음에는 [target1.GetFirstName] 그의 눈은 그 비늘고 흰색의 육지에 내려지기 전에 뒤로 물러났다. 당신의 어머니는 경험으로 미소를 짓고 손가락에서 씨앗을 빨리 청소합니다. [ROOT.Char.GetFirstName]? "\n\n"당신은 대답하지 않고 그냥 웃으며 손을 드레스의 어깨를 몸으로 끌어내며 가슴이 속옷에서 빠르게 빠져나가고 있습니다. 당신은 자신의 친척보다 땀을 흘리는 사람에게 더 관심을 가지고 반응합니다. 엉덩이가 옆으로 흔들리고, 몸의 절반까지 옷을 입고, 한 손을 그의 튼튼한 몸 위에, 다른 손을 어깨에 두었습니다."\n\n"이 남자가 콧물 흘리고, 마치 황소처럼, 손을 내밀고 일을 끝내고, 옷을 찢어내며, 그 똥구멍을 드러내죠. 아랫부분을 자극하고 고양이를 괴롭히면 입술로 가슴을 숭배하기 전에 그의 입술에 스무치를 찌르며 공로를 보답합니다."\n\n"엄마의 목소리, 너 둘을 쳐다보며 그녀의 목소리로 무력화되어 아래로 내려다보며, 유전적 자료가 수면으로 흘러나오고 있습니다."\n\n"엄마... 당신은 마우를 하고, 그 남자가 옷을 벗고, 이제 침대에 누워서, 그녀의 다리를 끌고, 당신과 다시 맞닿아 있습니다. 그녀의 입술에 미소를 짓고, 그녀는 바로 그렇게 하고, 당신이 모부님을 찬양할 수 있게 해줍니다. 침대 위에 굽는, 그것은 볼 수 있는 광경이었다[target1.GetFirstName] 백인 소녀들의 매춘기를 직접 경험하고 있습니다. 그녀의 입구에서 당신의 입술이 배고프게 젖을 고, 혀가 잔해를 으며, 그 소금한 맛을 먹기 전에 그녀의 부드러운 손은 당신의 머리의 뒷부분에 도달하고 그녀의 긴 손톱을 당신의 실크 머리카락에 묶고 있습니다.\n\n"두 개의 작은 스노우파니[target1.GetFirstName]무즈, 당신의 배후에 박을 내리고, 그것을 흔들리는 것을 지켜보고, 당신의 입구와 그의 bitchbreaker를 조정하기 전에. 손쉽게, 그는 당신의 어머니에 의해 기름부음받아 들어갑니다. 인치에 인치로, 그는 당신을 채우고, 벽이 밀접하게 그를 둘러싸고. 젠장... 이 똥은 너무 좋네요. 그는 고개를 숙이고 또 다른 턱을 습니다."\n\n 발가락이 꼬여서 발가락을 깊게 고, 발가락은 뛰고, 엄마처럼 널 채우려고 하고. 그의 톱은 자궁경부 을 고, 그가 뒤로 물러나기 전에, 당신의 눈은 이크스타시로부터 돌아다닙니다. [target2.GetFirstName] 그 여자애가 그 삐걱거리는 흰 엉덩이를 치면서\n\n"아뇨, 아뇨 너무 잘하고 있어" # AI Tags
bno_random_2002.desc2: "현실은 엄마의 열망한 애정에서 당신을 흐려버립니다. 그녀가 결혼 침대에서 당신의 아버지를 제외한 다른 사람을 갖고 싶어하는 것처럼 보이기 때문에 완전히 놀랐습니다. 당신은 정치의 영역에서 성관계가 엉망이라는 것을 알고 있었지만, 당신은 당신의 어머니가 낮은 출생자와 잠을 자는 것을 상상조차 할 수 없었습니다. 굴핑, 당신의 마음은 울타고 그가 당신을 이 세상에 낳은 여성에게 무거운 짐을 부어넣을 때, 그녀의 유성 달걀이 남아있는 것은 배아가 될 것입니다.\n\n 의심을 품고, 거의 떠나기로 결심했지. 거의\n\n 네 엄마가 몸부림을 올릴 때, 그녀는 엉망에 내려다보죠. [target1.GetFirstName] "튀어나오면서 손가락을 긁어내면서 똥을 닦았습니다. 이 점에 빠져있어서, 당신은 어두운 학생들의 집합이 당신을 쳐다보고 있다는 걸 알아차리지 않았죠. 현재는 그의 막대기에서 을 닦고 있습니다. 아, 당신은 그의 목소리는 급속히 당신의 관심을 끌고, 당신의 존재를 연인들에게 드러냅니다."\n\n 그 남자가 달릴 뻔한 것 같았어요. 당신이 서 있는 동안, 문 앞에 얼어붙어있었죠. [target2.GetFirstName] 이 사실을 깨닫고, 침대 시트를 뒤집고, 눈을 알아차린다. "[ROOT.Char.GetFirstName]"그녀는 시끄럽고, 그녀의 목소리는 꿀처럼요. 아아아.. 그녀는 다시 울고, 아마도 유혹했던 같은 목소리를 사용했습니다.[target1.GetFirstName].\n\n"엄마? "라고 외치면서 문을 좀 더 열어보죠. 마치 헤드라이트에 있는 도인처럼요."\n\n"예, 귀여워요? 그녀는 상황에 대해 무관심하게 묻습니다. 그녀의 황새가 그녀의 옆에 서있으며, 당신과 마찬가지로 불확실합니다. 오세요, 들어와요, 귀여운여 그녀는 같은 어머니의 목소리로 말합니다."\n\n"그 시선에 사로잡혀, 당신은 주개를 숙이고, 몇 걸음 들어가서, 어머니께서 지시하신 대로 문을 닫습니다. 럭셔리 매트러스에 접근하면 아래쪽의 다리가 떨리는 것을 느낄 수 있습니다. 엄마... 무슨..."\n\n"시어... [ROOT.Char.GetFirstName]. 여기 와서". 그녀는 빠르게 대답, 당신을 침묵. 그녀의 팔을 뻗어, 그녀는 그녀의 손가락에 매끄러운 씨앗을 보여줍니다, 그녀의 입술에 미소. 단 한 마디도 하지 않고 본능적으로 입을 열고 그 섬세한 손가락이 덩어리, 색 입술을 지나가게 하고 맛을 엿볼 수 있는 맛을 느낄 수 있습니다.\n\n",. 그냥 그렇게. 그녀는 울고, 너 너 너머를 쳐다보고,[target1.GetFirstName] 청결한 허락을 받아 드레스를 걷기 시작해 콩 모양의 뒷부분을 드러내세요 "어머니의 품에 누워라. 네 새 형제의 아버지한테 보여줘" # AI Tags
bno_random_2002.a: "내가 다! I-I-EEEP!" # AI Tags

bno_random_0003.title: "비밀 정원은" # AI Tags
bno_random_0003.desc: "온화한 바람이 여러분의 가족의 정원들을 휩쓸고 있던 오랜 나무의 잎을 니다. 이 정원은 당신이 자랐고 자랐던 정원과 같았죠. 다양한 활기찬 줄기들 사이에 네 이름이 새겨져 있었습니다. 울타리를 돌아다니면서 언니와 만나기로 했지 [target2.GetFirstName], 가제보에서 영역 내의 문제를 논의하기 위해 주로 여성 비사일에 대한 더 많은 권리를 주장하는 것에 초점을 맞추었습니다. 새들은 그 가지들 사이에서 평온하게 윙윙윙하며, 궁전 안에서 '폭풍'이 불어오는 것을 견제합니다.\n\n 속삭여 있는 대화의 부드러운 속삭이는 귀에 귀가 들으며, 목소리들을 감지할 때 위로 올라간다. 조심스럽게 잎의 일부를 한쪽으로 밀어 넣고 충격적인 장면을 목격합니다. [target2.GetFirstName] 이봐요! 그리고 그녀는 혼자가 아니었습니다. 사실, 그녀의 팔에 묶여서 그녀의 위로 올라가는 궁중은 피부색이 뚜렷한 것으로 유명했습니다.\n\n 당신은 잠자리를 시도하지 않습니다, 당신의 눈은 그들의 상호적인 애정을 훈련, 당신의 여동생의 분홍색 입술이 녹아 [target1.GetFirstName] 그의 혀는 확실히 그녀를 침략하는 것입니다. 집회 장소 에서 몇 발자국 이 떨어진 곳 에서 멀리 떨어져 나가는 것 을 생각 할 때 귀 에 따뜻 한 느낌 을 느낄 수 있습니다. 그러나, 당신이 머물면서, 당신은 그의 손을 그녀의 몸 아래로 이동하는 것을보고, 그녀의 곡선 허벅지를 지나, 그녀의 뒤로 (당신이 단지 조금 질투), 갈색 바지를 입고. 그의 발자국이 깊어지고 그의 눈에는 육신적인 욕망이 있습니다." # AI Tags
bno_random_0003.a: "왜 그런지 이해해 [target2.GetFirstName] 좋아해요 하지만, 내가 그들을 맡기는 게 낫다." # AI Tags
bno_random_0003.b: "[target2.GetFirstName] - 그래? 제발, 나랑 같이 가자!" # AI Tags
bno_random_0003.c: "[target2.GetFirstName] 이봐요! 무슨 짓을 한 거야?" # AI Tags

bno_random_2003.title: "비밀 정원: 침투" # AI Tags
bno_random_2003.desc: "네 삐걱거리는 목소리가 이 쌍을 찢어 버립니다. 그들의 입술에서 서로의 입술로 이어지는 침줄이 있습니다. 하지만, 관리가 잘 된 울타리를 돌아다니면서, 목소리에서 호소하고 눈에는 절망이 느껴지는 것을 거의 알아차리지 못합니다. [target1.GetFirstName] 네... 성적 선호도. 그의 몇몇 형제들은 당신의 몸의 감각을 언급했고, 그 모든 것을 볼 수 있는 유연성, 그리고 당신만큼 좋은 사람을 배려하는 것이 얼마나 좋은지 언급했습니다.\n\n[target1.GetFirstName] 너한테 돌아서서서 입술에 미소를 짓고 그의 뒤에서, 당신의 여동생은 소리치고, 거의 그를 두 사람 사이에 보호자로 사용한다. 하지만, 당신의 코르셋은 확실히 그를 무력화시켰을 겁니다. 이 당신을 향해 다가왔을 때\n\n"누가 너희 둘 다 혈통을 망치고 싶다고 생각했을까? 그러나 당신의 열정이 다른 것을 증명하는 데 도움이 된 것은 손들이 끈을 능숙하게 잡고, 코르셋을 느슨하게 하고, 또한 왕복을 벗어날 수 있도록 도와주는 것입니다."\n\n"나랑 내 여동생... 여러분들은 서로 얽혀서 헐벗은 몸을 드러내고,[target2.GetFirstName]그 남자의 바지를 만들기 시작했어요. 그래서 난 그냥 그녀에게 용의를 하려고 해요.[target1.GetFirstName] 똥이 방역에서 빠져나오면서 이미 똥을 흘리고 있습니다.\n\n" Hmph 는 그가 대답하는 전부입니다. 두 사람을 화석 벤치로 이끌기 전에, 당신은 빠르게 그 위에 굴복하고, 빛나는 똥 입술을 벗고 있습니다. 오늘밤 끝낼 수 있을 것 같네요, 창녀님. 그는 비틀거리고, 그의 목소리가 헐렁하고, 그의 거친 머리는 내려가자"\n\n"그녀의 옆으로 [target2.GetFirstName]. "그 엉덩이를 볼 필요가 있다". 그는 덧붙여, 그의 똥은 심지어 완전히 당신의 내부에, 다시 롤하기 시작하기 전에, 앞으로 돌아 닦는. 네 여동생은 곧 옆으로 올라와 얼굴이 붉어지고 있습니다.\n\n"너도 흑인이냐?" # AI Tags
bno_random_2003.a: "젠장! 젠장, 그래! 맙소사!" # AI Tags

bno_random_0004.title: "미친 리지" # AI Tags
bno_random_0004.desc: "낮 12시 직후 의 소환은 색 잉크로 읽혀져 있습니다. 보통은 반대의 일이죠. 당신은 제왕을 만나기 위한 시간을 마련하게 되죠. 대신, 당신은 심각한 실수로 그녀의 법정에 소환되었습니다. 일요일 베일을 입고, 활기찬 녹색 드레스를, 루비 크로스 목걸이를, 은 팔찌를 그리고 옷장 안에 있던 모든 것을 입고 있었다. 조용하게, 당신은 그것이 충분하다고 희망, 당신은 왕좌 방으로 당신의 길을 찾을 때."\n\n 그러나 너희 앞에 있는 현상은 완전한 타락의 현상이라 너무 말도 안되는 것을 예상하지 못하면서 눈은 넓어집니다. 그녀의 뒤에서 털이 덮여 있고, 당신은 일찍 도착했지만, 당신은 당신의 신부들이 이 새로운 난민들에 대해 그렇게 집착할 것이라고 예상하지 못했습니다! 짧게 보면, 어두운 피부의 남자는 왕좌에 누워있으며, 그의 똥을 무단으로 빨아들여서\n\n"하지만, 당신은 자신을 도울 수 없습니다, 당신의 이 밝은 빨간색으로 변합니다. 제 영주님, 당신의 몸은 이상한 분노로 불타고 있습니다. What-what are you doing? 하지만, 그녀가 자유로울 때, 그녀의 앞에 앉아있는 남자가 미소를 짓고, 그녀의 머리를 낮추고,[bno_bbc|E]. 더 이상 당황스러운 현장에 머무르지 않고, 여전히 놀란 채 발자취합니다." # AI Tags
bno_random_0004.a: "저 남자가 누구라고 생각하니?" # AI Tags
bno_random_0004.b: "이 영역은 미쳤어!" # AI Tags

bno_random_1004.title: "미친 거짓말: 당신에게 노출" # AI Tags
bno_random_1004.desc: "떠나기 위해 회전할 때, 당신은 다시 돌아보게 될 수 없습니다 - 로트의 아내가 소돔과 고모라를 떠나고, 또는 오르푸스가 사랑하는 사람을 찾기 위해 돌아가는 것처럼. 당신의 부드러운 눈은 또 다시 그 현장에 시선을 기울이고, 그가 그녀의 목의 한계를 벗어날 때 지켜보고,\n\n 그는 한 엉덩이를 펌프합니다. 두꺼운 끈이 당신의 리지의 얼굴에 쏘기 전에, 그의 음량에 놀랐고, 그 뒤를 따라 다른 열여섯 개의 끈이 이어집니다. 단 한 번만 [target1.GetFirstName] 당신을 보세요, 기쁨으로 머리를 뒤흔들기 전에, 그의 연인은 그녀의 손과 입술을 사용하여 작업을 완료합니다.\n\n",... 쇼를 보여줘요. 그 애를 떠나는 남자, 그 애가 뭘 했는지 알면서 웃는 남자. 또 한 번 더 엿볼 수 없다면, 당신은 부끄러움으로 부적절함을 피하고, 당신의 양변은 수치심으로 빨라집니다." # AI Tags
bno_random_1004.a: "적어도 그녀는 이 문제에 대해 솔직합니다." # AI Tags

bno_random_2004.title: "미친 거짓말: 감정 을 감추는 것" # AI Tags
bno_random_2004.desc: "당신은 거의 시간을 낭비하지 않습니다, 당신의 의 질식 소리가 법원을 가득 채우고, 마침내 들 수 있는 '팝'로 철수. 그가 그녀의 머리를 가만히 두어, 그녀의 얼굴에 짐을 돌리고\n\n [ROOT.Char.GetFirstName]잠깐! 그녀는 발걸음을 치고, 발걸음 치며, 당신을 잡으려 합니다. "그게 겉보기에는 그렇지 않다!" 그녀는 그녀의 고급스러운 발꿈치 중 하나가 휘어지고 튀어나오며, 거의 새로운 메이크업 세트를 가지고 고급스러운 타일에 뛰어들게 만들었다 -[target1.GetFirstName] 이니까\n\n 당신 뒤에 문을 고, 당신은 조롱하고, 심지어 바닥에 문장을 던지기도 합니다." # AI Tags
bno_random_2004.a: "여보야! 그리고 저는 프로젝션을 하지 않습니다." # AI Tags

bno_random_0005.title: "검은 목욕탕" # AI Tags
bno_random_0005.desc: "긴 일주일 동안 법정적인 일을 한 후, 당신은 이미 수집하고 묶여있는 당신의 물건들을 잘 자격이있는 목욕을 할 것을 결정합니다. 어느 정도 휴식을 취하기를 희망하며 왕실의 목욕탕으로 내려가며, '여성'의 예정된 시간 이 시작되자 얼마 지나지 않아 도착합니다. 머리카락을 떨어뜨리고 화장품을 지우고 옷을 벗기 시작하면 집 한 모퉁이에 더 어두운 피부를 가진 그림자가 왈스하는 것을 보게 됩니다. 네 눈을 고, 이미 완전히 벌거벗은\n\n 처음에는, 당신의 눈은 서로 만나는 경로를 교차하고, 둘 다 잠시 방황하기 전에 - 당신의 절대적인 코끼리 트렁크에 내려가는 당신의 유연한 가슴. 당신이 그 사람을 인식하기 시작하면, [target1.GetFirstName] 그의 문화가 당신 문화와 다르다는 것을 조용히 이해했습니다. 어색하게 움직이고, 그의 몸은 땀과 증기로 빛나고, 당신을 지나가기 시작하고, 이 옆으로 흔들리고 있습니다.\n\n"죄송합니다. 그는 모이고, 그의 억양이 두꺼워, 그의 수건을 헝거에서 고, 당신의 손을 당신의 개인 영역을 덮고. 하지만, 당신의 무죄한 눈은 당신을 배신하고, 여전히 그의 유혈색 멤버에 매달리고, 그가 다시 말했을 때만 떠납니다. "좋아요?" 그는 물었습니다. 입술에 미소를 짓습니다."\n\n"네 입은 물에 빠지지 않을 수 없어, 사실상 이미 그를 위해 벌거벗은 채, 그냥 자기 자신을 드러내지 않을 수 없다. 넌 내 엉덩이를 좋은 창녀처럼 잡아먹을 거야?"\n\n 당신의 눈은 급속히 솟아오르고 그가 지금 당신 앞에 서 있는 것처럼, 그의 깎은 몸은 유혹에 너무 크다." # AI Tags
bno_random_0005.a: "- 그래요" # AI Tags
bno_random_0005.b: "무슨 소리야? 아뇨! 경비원!" # AI Tags

bno_random_1005.title: "검은 목욕: 좋은 가녀가 되는 것" # AI Tags
bno_random_1005.desc: "그는 웃으며 손바닥을 들고 부드럽고 멋진 머리카락을 만져보고 어깨를 만지고 긁게 합니다. 잘생긴 여자"\n\n"그 말을 듣고 척추가 떨고, 다리가 본능적으로 내려가 무릎을 꿇고, 옷이 다리에 썩어 버렸습니다. 이 각도에서, 당신의 머리는 그의 똥과 같고, 눈은 그 펄스를 보고 당신은 가슴에서 손을 올려놓고, 분홍색 을 드러내며, 따뜻한 고기를 조금 끌어내려요. 상상할 수 있는 모든 것이었죠. 몸을 기울여서 입술의 끝을 찌르며 눈은 그의 쪽으로 날아다니며 서서히 그의 머리를 맞이하기 위해 엉덩이 베개들을 갈라놓습니다."\n\n"" 음... 한 손이 똥을 펌프하고 다른 손이 무거운 공을 가지고 놀기 시작합니다. 목욕탕에 향기가 들렀지만, 이 사람의 머스크는 당신의 코 구멍을 채우며 그 상황을 압도했습니다. 당신이 그를 몇 인치 아래로 갈 때, 한 손이 당신의 머리 뒷부분에 합류하여 머리카락을 얽매여서 더 아래로 밀어 넣을 수 있습니다."\n\n"" " GLLLRRRRKKK!" "" "그놈이 짖는 동안 좀 윙윙윙" 분명히, 그는 당신의 투쟁을 즐기고, 당신이 그를 질식하는 것을 보고, 그가 필요하다고 생각했을 때만 당신의 얼굴의 털이 니다. 다시 한 번 하면, 그는 당신을 고 게 하고, 얼굴을 기 시작하고, 당신의 코를 그의 덩굴 뼈에 밀고, 그의 공은 당신의 턱에 박수를 붙이고 땀이 땀을 흘리는 것과 콧수염이 어떤지 알기가 어렵습니다. 그의 잔인함에 눈물이 찢어지면서"\n\n"젠장... 젠장... 이 똥을 먹으세요. 그는 고개를 끄덕이고, 당신을 손쉽게 끌어내기 전에, 그의 좆을 완전히 만지고 있습니다. 네가 알아차리기 전에 그는 이미 네 귀여운 얼굴에 밧줄이 하나씩 쏘고 있어" # AI Tags
bno_random_1005.a: "아아아아~" # AI Tags

bno_random_0006.title: "아침 나무" # AI Tags
bno_random_0006.desc: "아침 햇빛의 첫 번째 빛은 당신의 방의 창문을 통해 뚫고, 당신의 침실로 흘러들어오고, 이 곳을 아침 빛으로 채우게 됩니다. 전날 밤 파티에서 머리가 아프면서 기대감을 가지고 움직입니다. 네, 또 다른 '타버너에서 친구들과 나가는' 밤 외출 중 하나, 당신 스스로의 친절으로 지불한 청구서입니다. 어떤 담요를 뒤집고 옆에서 뒤집어 돌 벽돌 천장에 올려다보며 방 내의 이상한 추위를 감지합니다. 아래로 내려다보면, 브래튼이 없어진 것을 깨닫습니다. 그리고 그 후에도 눈은 왼쪽으로 향하고, 강력한 군인의 틀이 옆에 있다는 것을 깨닫게 됩니다. 그의 얼굴은 순식간에 붉어지고 가슴에 심장 박동이 일어났습니다. 그가 여전히 잠자리에 누워있으며,\n\n 서둘러 더 많은 빈키를 내밀고, 실제로 속옷도 놓쳤다는 것을 알 수 있습니다. 즉시, 당신은 상황을 두려워, 당신의 공황에 당신의 밤 파트너를 자극합니다.\n\n 뒤집어지고, 그의 깊은 감각적인 목소리는 음으로 울고, 그의 한 손은 당신의 옆구리에 마찰됩니다. 몸을 기울여 네 목을 키스하고 공포의 충격을 주고 있습니다. 당신의 눈은 넓어지고, 그를 돌아보며, 그가 당신에게 더 긴 스무치를 뱉을 때 굴복하게 웃기 시작합니다.\n\n"어젯밤 잘 지내셨죠. 두 사람이 함께 했던 밤을 분명히 기억하고 있습니다. 반대로, 당신은 어떤 것도 기억하지 않습니다, 대신 그의 발전에 적용됩니다, 뚜 밑에 뭔가가 있어요 제가 떠나기 전에 저를 청소할 수 있다고 생각하시나요?" # AI Tags
bno_random_0006.a: "네, 내가 도와줄게" # AI Tags
bno_random_0006.b: "G 경비원! 도와줘!" # AI Tags

bno_random_1006.title: "아침 나무: 잘라내" # AI Tags
bno_random_1006.desc: "머리를 찌르며, 당신은 곧바로 당신의 침대에 도착한 남자를 서비스하기로 동의합니다. 이름조차 확신하지 못합니다. 그는 당신의 엉덩이를 조금 마찰하고, 일어나서 덮개를 완전히 버립니다. 그의 좆은 이미 딱딱하고 단단하고, 그 강한 다리 사이에 똑바로 서 있습니다. 은 입술은 여전히 약간 고 있고, 다른 손은 준비 중에 몇 가지 펌프를 줍니다. 와오 그는 침착하게 말했다, 그의 허벅지를 박아, 당신을 기다리고."\n\n 명령에 따라 침대에 서서히 내려가며 수직 각에서 그의 똥을 똑바로 습니다. 옆에서 보면 그의 똥에서 나오는 섹스의 독특한 향을 느낄 수 있습니다. 뭔가... 그의 막대를 덮고 있습니다. 손가락을 찌르며 천천히 그의 고기를 먹으며, 그의 똥에 찔려 있던 똥의 잔해를 맛보죠. 아마추어로서, 당신의 분홍색 혀는 그를 둘러싸고 움직이고, 마치 집어넣은 황소처럼 고개를 숙이고 콧물을 흘리게 한다.\n\n"아타 소녀... 천천히 우리가 얼마나 좋아하는지 아세요. 그는 화를 내며 어제 밤의 술에 취한 공연을 바탕으로 이미 전문가였다고 암시합니다. 그럼에도 불구하고, 당신은 자신의 취향에 만족하고 성취감을 느끼지 않을 수 없습니다, 혀를 청소 모든 인치, 그의 frenulum에 특별한 주의를 기울이고, 그의 길이를 굽히고 있습니다."\n\n"젠장 마녀야 그는 당신의 머리에 손을 얹고 엉덩이를 묶고 짐을 풀지 못해 분명히 전날 밤의 인내심을 깨뜨렸어, 그의 비스카스 씨가 입을 채우고 있어. 펌프 하나씩 펌프를 고, 머리를 뒤로 기울이고 긴장된 몸을 풀어줍니다. 한 번만 그의 손이 당신에게 떨어질 때 당신은 물러나야 할 필요성을 느끼며, ""와 함께 떨어집니다."\n\n 엉덩이를 치고, 너무 큰 혼란을 일으키지 않으려고, 그의 뱉은 똥을 내려다보고, 당신의 입을 닫고, 그의 성분으로 가득 차 있습니다." # AI Tags
bno_random_1006.a: "구프!" # AI Tags

bno_random_0007.title: "중세 포식" # AI Tags
#bno_random_0007.desc: "The sun sets over the vast expanse of your realm, casting a warm golden glow across the castle walls, you find yourself feeling a sense of tingling for some BBCs. Memories of big black cocks, the way it penetrates your womanhood, flood your mind.\n\nDriven by the desire to relive those memories, you decide to organize an intimate gathering in one of the castle's private chambers with one of your African courtiers. You call on to [target1.GetFirstName]..."
bno_random_0007.desc: "밤이 당신의 영역을 점령할 때, 당신은 당신의 내면에 을 느끼지 않을 수 없습니다. 여러분 중 일부는 질병에 걸리거나 좋아하는 과일을 갈망하고 있는지 궁금했습니다. 그러나, 어둠이 당신의 궁전 위에 떨어지면서, 당신의 방에서 휴식을 취하면서, 당신은 당신의 헛소리를 바라보며, 당신이 필요로 하는 것을 정확히 알고 있었다. 일어나서 그 쪽으로 향하고, 당신은 드래스를 열고, 비밀리에 만들어진 성 장난감을 드러냅니다. 손가락을 뚫고, 당신은 의문을 품고, 어두운 오크가 다른 것을 상기시켰다는 것을 깨닫습니다.\n\n 여성으로서의 감각은 자신을 회복시키며, 좀 더 얇고 얇은 속옷을 입고, 새로운 자르터, 그리고 화려한 보석으로 장식하는 동안 침투합니다. 첫눈에 봤을 때, 당신은 파티에 갈 것이라고 생각했을지도 모릅니다. 대신, 당신은 찾고 있었다 [target1.GetFirstName].\n\n 당신의 집의 통로를 거쳐서 발걸음을 치고 다른 관장들을 지나가면서 마침내 그를 발견했습니다. 다른 손님들 네 에 있는 미소, 붉은 입술은 그가 알아야 할 전부였어, 당신의 향기의 한 냄새가 당신을 방으로 데려다 줄 수 있었습니다." # AI Tags
bno_random_0007.a: "제발 네 큰 검은 똥을 줘!" # AI Tags
bno_random_0007.b: "내가 준비됐어, 아빠" # AI Tags
bno_random_0007.c: "난 상관없어" # AI Tags

bno_random_1007.title: "중세 포트 콜: 퀴키" # AI Tags
bno_random_1007.desc: "거의 방으로 돌아다니며 [target1.GetFirstName] 당신의 여성적인 욕구를 충족시키는 데 도움이 될 수 있도록 동의합니다. 아프리카 닭에 뭔가 매혹적인 점이 있었는데, 그를 초대하면서 웃는 것을 멈출 수 없었어요. 절박하게 그를 침대에 앉히기 위해서요.\n\n 그가 바지를 벗고 육류를 달고 있는 을 벗으면서 문이 잠겨있다는 것을 확인하고 뒤집어 뒤돌고 윗부분을 벗고 화이트 버스터를 드러내려고 합니다. [target1.GetFirstName] 웃으며, 무릎을 꿇으면서 얼굴의 머리카락을 벗기고, 입술은 흥분으로 빛나고 있습니다.\n\n"서둘러 기 시작해 커피웨이 전에 샤워를 해야 합니다. 그는 거의 고, 욕구로 활력을 불어넣습니다. 배고프면서 빨리 그의 똥을 잡아먹고, 이건 네 첫 검은 똥이 아니잖아 당신 입술 은 거의 그 의 절반 을 쉽게 삼키고, 당신 자신 의 리듬 에 따라 튀어나오기 시작 하며, 당신 의 '서비스' 를 온전히 누릴 수 있게 해 줍니다."\n\n"당신은 느슨하게 삐걱거리고, 발액이 혈관줄로 흘러들어오고, 양손이 다리 위에 있고, 도움 없이도 할 수 있다는 것을 보여준다. 하지만, 그는 만족하지 않습니다. 당신의 속도를 맞추기 위해 엉덩이를 약간 흔들고 있습니다."\n\n""는... 계속 하렴. 그는 다시 울고, 얼굴에 가벼운 박수를 주고, 탄압된 공격력을 보여주며, 그의 흰색 에 내버려 두었다. 그의 템포가 어릴리틱해지고, 호흡이 찢어지고, 그의 똥이 급속히 뛰고, 당신은 그가 당신의 입을 흰색으로 칠하기 가까이에 있다는 것을 알고 있습니다." # AI Tags
bno_random_1007.a: "맙소사 이봐요!" # AI Tags

bno_random_2007.title: "중세 성소수자: 아기 열" # AI Tags
bno_random_2007.desc: "당신은 거의 방으로 돌아갑니다. [target1.GetFirstName] 당신의 여성적인 욕구를 충족시키는 데 도움이 될 수 있도록 동의합니다. 아프리카의 닭에 뭔가 매혹적인 점이 있는데, 침대에 들기 위해 절실히 초청하면서 웃는 것을 멈출 수 없습니다.\n\n 그가 문을 처리하도록 하면, 당신은 급히 안으로 들어가서 발꿈치에서 빨리 빠져나갑니다. 끈을 풀고, 천을 어깨 아래로 굽히면, 당신은 빠르게 당신의 완전한, 한 인형을 드러냅니다. 꽃으로 꾸며진 주머니. 최선을 다하고 있어 침대에 뿌려서 웃고, 연인이 다가오는 것을 보고, 당신이 너무 사랑했던 것의 윤곽은 그의 바지를 통해 볼 수 있습니다.\n\n"백인을 위해 이런 짓을 하지 않죠. 그는 웅변적으로 묻습니다. 그 튼튼한 위를 보고, 그의 발목을 긁고. 이번엔 네가 일을 해야 하기 보다는 그의 손가락이 그의 바지에 미끄러져 발걸음을 내딛고, 그는 침대 옆에서 다리를 끌어내고, 당신의 하위 영역을 그의 구성원에게 더 가까이 끌어들이고 있습니다. 내 속옷을 찌르면 웃는 거야"\n\n"젠장... 확실해요? 그가 묻습니다. 당신이 그와 괜찮는지 확인하고, 여전히 탈출구를 제공합니다. 하지만 중독된 사람은 머리를 흔들고, 웃으며, 자신의 손으로 방해가 되는 섬유로 놀기 시작합니다. 네 쪽으로 아서, 그는 주먹을 숙이고, 그 속옷을 끌어내고, 네 다리를 들어 올려서 벗는다."\n\n"젠장, 이 고개를 끄덕이고, 그 붓고 분홍색 입술을 보고, 그를 구부짖는 거야. 손가락에 뱉어 입구에 마찰하고 네 시선을 다시 만나고 정말 이걸 필요해요. 그는 댓글을 달고, 줄을 서서, 고양이를 쳐다보며, 즉시, 엄청난 즐거움이 당신을 통해 날아가고, 발가락이 고 등이 구부러지고, 그의 똥이 당신의 꽉 찼다. 그는 고개를 숙이고 고개를 끄덕이고, 허리를 찌르고, 당신의 무경험이 사실이라는 것을 증명할 때,"\n\n"젠장... 젠장... 너무 꽉 차있어요... 을 고, 손으로 턱을 긁고, 엉덩이에서 일을 하고, 입술이 목을 짜고 있습니다. 당신의 삐걱거리는 울음소리는 방을 채우고 그의 똥은 마침내 덩어리를 깊게 고, 당신에게 둥지를 틀고 있습니다. 스무치의 젖은 소리들은 '로맨틱한' 시선을 더하고, 그의 머리를 들어 올리고, 그의 사랑으로 당신의 입술을 괴롭히기 시작합니다."\n\n 파운드당 파운드, 그는 당신을 깨고, 밖으로 내리지 않도록 하기 시작합니다." # AI Tags
bno_random_2007.a: "어쩌면 난 중독자일지도 몰라..." # AI Tags

bno_random_0008.title: "저녁 산책" # AI Tags
bno_random_0008.desc: "당신의 명예로운 왕국에서 조용한 오후에, 당신은 당신의 신중하게 유지된 정원을 통해 편안한 산책을 결정합니다. 장녀들은 넓은 초록색을 닦고, 관목, 과일 나무, 베리 덤불, 울타리를 유지합니다. 손님들이 돌아다니며, 당신의 성을 통해 길을 찾습니다. 당신의 정비자가 서있는 것처럼, 당신의 존재 속에서 질서를 유지하도록 보장합니다. 평화는 당신의 신경을 진정시키고, 최근 당신의 영역에서 벌어진 사건들 후에, 저녁 식사도 한 시간 후에요.\n\n 하지만 당신의 마당 안에서, 당신의 눈은 [target1.GetFirstName] "초록색의 고립된 부분에 펼쳐져 있고, 햇빛을 흡수하기 위해 셔츠를 벗고 있고, 그 어두운 음색은 잔디에 뚜렷하게 돋보인다. 몇 번 깜빡이는 그는 자신의 셔츠를 들고 헐벗은 몸 위를 덮고, 그의 을 방해하지 않기를 희망한다. 제 제사님, 그는 잔디에서 일어나서 서둘러 팔을 셔츠를 뚫고 뛰어내리려고 하더군요. '거벗은 것'으로 인해 방해받지 않고, 여자처럼 웃으면서 입술을 덮고 그에게 다가갑니다."\n\n" SUNBATHING 당신은 그를 놀래키고, 당신의 음모가 당신의 눈에 드러나고 있습니다. 그는 당신을 쳐다보고, 그의 셔츠가 반쯤에, 그의 파인한 허벅지가 여전히 노출되어, 입은 약간 아가페. 당신은 손을 뻗어[target1.GetFirstName] 곧 당신을 위로 올라갑니다.\n\n"그래요 언젠가 시도해야 합니다. 그는 뒤로 고, 그의 음색은 약간의 성적 충고로 부각되고, 당신의 눈은 그의 눈을 똑바로 쳐다보고 있습니다. 첫 걸음을 내딛고 가슴에 손을 얹고 덩어리가 꽉 차 있는 근육을 느낄 수 있습니다."\n\n"당신은 소원을 하고 있습니다. 당신은 스니커이고, 당신의 하강 입술을 씹고, 조용히 손을 초대하여 당신을 느끼며, 그는 당신의 허벅지를 빠르게 긁습니다." # AI Tags
bno_random_0008.a: "좀 더 매끄러울 것 같아" # AI Tags
bno_random_0008.b: "빨리 해 [target1.GetFirstName]." # AI Tags
bno_random_0008.c: "난 귀족이야!" # AI Tags

bno_random_1008.title: "저녁 산책: 입술 봉사" # AI Tags
bno_random_1008.desc: "발가락에 발걸음을 내딛고 더 많은 것을 요구하고 은 발톱이 그에게 달린다. 자신의 것을 빼앗아, 목을 고, 앞을 당신 쪽으로 밀어, 입술은 장난스럽게 당신 쪽에 춤추고 있습니다. 거래를 마무리하고, 당신은 그에게 압력을 가하고, 두 손으로 그 사람의 강한 가슴을 느낄 수 있고, 그의 힘은 매 매 매 근육에 얽혀 있습니다. 당신의 심장은 발짝 뛰고, 손바닥이 당신의 드레스를 돌아다니며 [target1.GetFirstName] 널 똥구리처럼 쓸 거야\n\n"반분 동안 키스를 한 후, 그는 물러나서, 한 손을 드레스를 끌고, 옷 밑에 손을 serpenting. 당신은 우리에 대해 조금이나마 열광적이잖아요. 그는 두 손가락이 당신의 G-string을 넘어서며 웃고, 속옷을 깨닫습니다. 두꺼운 입술을 긁고 작은 박을 쳤고, 그는 뒤로 물러나서 눈을 깜박여서 사과했습니다."\n\n"다음 주에 나와 함께 해를 닦아줄래?" # AI Tags
bno_random_1008.a: "같은 시간에?" # AI Tags

bno_random_2008.title: "저녁 산책: 꽃 을 방해 하는 것" # AI Tags
bno_random_2008.desc: "당신의 호흡이 막히고, 당신의 손이 그의 손을 끌고, 그를 이끌려고 노력합니다. 오, 오... 당신은 속삭이고, 확실히 다음 몇 분 안에 마지막으로 그런 말을 하지 않을 것입니다. 그를 납치하고, 당신은 주도한다[target1.GetFirstName] 비밀리에 당신 뒤에 정원의 한 가지로 가서, 주로 공용 도구로 사용되는 棚으로 데려갔습니다. 당신의 주도권을 받아서 [target1.GetFirstName] 허벅지를 잡아서 옷장 위에 앉는 시간도 낭비하지 않죠. 공기도 좀 무더워요.\n\n"빨리... 빨리... 당신은 속삭이고, 당신의 쾌적한 드레스를 걷고, 당신의 입술을 물고, 아드레날린이 당신의 몸으로 급증하고 있습니다. 당신 앞에 있는 남자가 자신의 몸을 당신의 몸에 누르고 있습니다. 셔츠는 여전히 반쯤에 있습니다. 큰 손들이 바지를 고 있습니다. 정원생들이 돌아오기 전에... 당신은 마우를 하고, 그의 입술을 압박하고, 그의 손을 내밀고, 그의 똥을 끌어내고, 이제 당신의 드러난 에 움직이고 있습니다."\n\n"손쉽게 옆으로 밀어주고, 당신을 가까이 끌어들이고, 그의 똥에 손을 잡고, 자신을 안내하고, 다른 하나는 엉덩이를 매고 있습니다. 은 발가락이 입술에 튀어나오며 척추에 을 발송합니다."\n\n"제발... 당신은 시끄럽고, 그의 허리를 뒤덮기 시작합니다. 이 아프리카의 똥을 줘요. 당신은 시끄럽고, 그의 똥으로 가득 차서, 엄청난 환희를 느낄 수 있습니다. 그는 또 다른 키스로 당신을 감싸고, 허리들이 이미 흔들리고, 그의 길이가 당신의 열정에 힘입어 들어와 나가고 있습니다."\n\n"그의 속도는 점점 더 빨라지고, 엉덩이가 당신의 엉덩이에 부딪히고, 당신을 다시 벽에 밀고 있습니다. 허리 활이 고 울고 다리가 흔들리기 시작했고 그는 당신의 G 점에 을 때리고 그의 끝은 거의 당신의 자궁에 두드러졌습니다. 왕실의 창녀 좆같은 놈이 울면서 엉덩이를 치고, 입술의 제한 없이 그렇게 할 수 있게 하고, 작은 창문을 채우고 본능적으로, 그의 손은 당신을 질식시키기 위해 올라갑니다. 당신의 비참한 울음을 침묵시키려고 합니다. 당신의 몸은 천상의 오르가즘으로 당신의 인종을 배신합니다." # AI Tags
bno_random_2008.a: "난 고 있어!" # AI Tags

bno_random_0009.title: "왕비 에 적합 한 왕좌" # AI Tags
bno_random_0009.desc: "왕좌에 앉아, 당신은 당신의 지하들, 특히 당신의 나라의 비솔을 듣습니다. 몇 가지 질문으로 그들을 굽히고, 당신은 그들의 기록에 그들의 표지판에 문장 앞에 당신의 법원의 앞쪽에 있습니다. 위로 보고, 당신은 발견 [target1.GetFirstName] 경비원들과 논쟁을 벌이고, 경비원을 지나가며 행진을 벌였습니다. 그가 어떻게 지나갔는지 확실하지 않은 상태에서, 당신은 강한 근육이 묶여 있는 남자가 당신의 고장에게 다가오는 것을 보고,\n\n 당신은 울고, 당신의 경호가 즉시 주의를 끌고, 공격자에게 자신의 검을 뻗어. 하지만, 빠른 반응으로, 당신은 모든 사람들에게 진정하라고 말하고, 당신의 무한한 지혜가 당신에게 [target1.GetFirstName], 당신의 연인이, 다른... 당신을 냉혈로 죽이는 것보다 그는 당신의 귀에 그의 입술을 기울여:\n\n"난 네가 하는 일을 알고 있어 그리고 제 배상금을 받을 때가 됐다고 생각합니다. 왕좌를 내게 줘" # AI Tags
bno_random_0009.a: "아주 잘, 난 네 큰, 검은 똥에 앉을거야!" # AI Tags
bno_random_0009.b: "미안해... 죄송합니다." # AI Tags
bno_random_0009.c: "어떻게 여기까지 오셨죠?" # AI Tags

bno_random_1009.title: "왕비에 적합한 왕좌: 톱니" # AI Tags
bno_random_1009.desc: "그의 입술은 당신의 왕좌에 앉는 두 가지 전망에 흔들려 웃음으로 니다. 손잡이가 손목을 잡아서 조금 잡아먹는다. 일어나자 그는 강제로 왕좌에서 당신을 제거하고 법정 앞에서 땅에 밀어 넣습니다. 장관들은 숨을 쉬고, 여자들은 눈을 돌고, 얼굴이 붉어지고, 경비자들은 당신의 기꺼이 굴복을 보고 놀랐습니다."\n\n"손을 들어서, 그는 당신의 에 박을 때리고, 당신에게 뱉어내기 전에, 그의 비난에서 아무것도 억제하지 않습니다. 그럼, 가자 부끄러워하지 마, 스노프 니. 그는 그의 바지를 끌고, 당신의 궁중의 대부분의 남성들을 쉽게 어 버리는 윙윙, 당신은 여전히 통증의 찔러서, 하지만 당신은 당신이 말하는대로 합니다. 빨리, 당신은 위로 보고, 그 에베니 이 그냥 누워있는 것을 보고, 천천히 당신의 얼굴에 올라가는."\n\n 그의 발걸음을 따라, 당신은 당신의 드레스를 어깨 아래로 굽히기 시작, 법원에 당신의 벌거벗은, 벗은 몸을 드러내는. 부끄러움을 느끼지 않고, 당신은 그의 무릎을 꿇고, 그의 부드러운 똥을 가지고 놀고, 가슴을 단단히 하고, 그가 다이아몬드로 변할 수 있을 만큼 가슴을 굳히게 합니다.\n\n"저기, 저기. 내놔 토끼... 그리고 새 왕에게 인사하라. 그는 웃고, 당신이 요청받은 대로하는 것 외에는 선택의 여지가 없습니다. 당신 입구와 그의 똥을 맞추고, 당신은 자신을 낮추고, 숨쉬고 고개를 끄덕이고, 당신의 귀여운 작은 황금 티아라가 당신의 굴복의 징조가 되고, 당신의 리더십이 아닙니다." # AI Tags
bno_random_1009.a: "착한 여왕이 되어 계속 엉덩이를 뛰고 있어" # AI Tags

bno_random_2009.title: "왕비 에 적합 한 왕좌: 사내 에서 논의" # AI Tags
bno_random_2009.desc: "[target1.GetFirstName] "잠시만 물러서서서 왕실에서 올라갈 수 있게 해 주며 머리 위에 티아라를 조정합니다. 면제해 죄송합니다. 당신은 당신의 비솔에게 굴복하고, 대신 당신의 목동과 관객을 갖는 것에 만족하기 위해 양보를 취합니다. 옆으로 뻗어, 당신은[target1.GetFirstName] 당신과 함께, 주경호의 귀에 기울여서 그들을 배제하고, 에본 신이 주변에 있는 것을 경계할 필요가 없습니다.\n\n 그들은 당신이 무엇을 하고 있는지 정확히 알고 있었고, 당신은 그를 법정에서 멀지 않은 곳으로 이끌었고, 주로 외국 손님이나 통치자를 일시적으로 보관하기 위해 사용되는 옆방으로 향했습니다. 그 대신, 이제, 그것은 앞선 왕을 수용할 것입니다. 그의 어두운 피부는 당신의 경계 내에서 대조됩니다.\n\n"문 닫고, 문을 잠그고. 한숨이 당신의 입술을 떠나서[target1.GetFirstName]손들이 이제 찢어지고 섬유를 느슨하게 하고 있습니다. 이제, 무엇이 필요했습니까? 당신은 쿨하고, 당신의 목소리가 부드럽고 실크한 것처럼, 당신의 가슴은 당신이 자유롭게 튀어나왔다. 그의 얼굴의 재미는 읽을 수 있고, 당신을 약간 웃게 만듭니다. 당신 가까이 다가오면 그의 손들은 즉시 당신의 젖은 가슴을 잡아먹고, 그의 아이들을 먹일 수 있는 것을 느낄 수 있습니다."\n\n"엿먹은 놈이 속삭이고 네 가슴을 고 있어 넌 그렇게 쉬워요. 그는 똥이 굳어있다는 것을 느끼며 소리 지르죠. 그는 당신의 발걸음을 밀어주고, 당신은 의심할 여지없이 그의 발기를 느낄 때 미소를 짓습니다. 굽히면, 그는 요구합니다, 당신은 순종하는 데 문제가 없습니다."\n\n 주위를 돌고, 문을 받침대로 이용하고, 90도까지 구부러지고, 옷에 거의 숨겨지지 않은 부드러운 엉덩이. [target1.GetFirstName] "그는 자신의 시킨을 자유로울 때, 자신의 시간, 그것을 느끼고. 젠장, 여자아. 그는 울고, 당신의 물건을 보기 위해 드레스를 끌어 올립니다. 웃으며, 그는 그가 좋은 시간을 보내고 있다는 것을 알고, 그 검은 G-줄이 당신의 욕구적인 엉덩이와 가난한 입술에 의해 잡아먹는 것을 발견합니다."\n\n"그는 당신의 입구로 자신의 정맥성 똥을 향하고, 그 황당한 물질을 편리하게 밀어 넣을 수 있도록 끌고 간다. 그린팅, 그는 당신의 경주에서 경험이 있다고 볼 수 있습니다. 당신의 엉덩이를 잡고 엉덩이에 애를 걸고, 당신의 기적적인 버스트를 때리기 전에. 하얀 소녀들이 엉덩이를 가지고 있다는 걸 몰랐어요. 그는 거짓말을 하고, 하단에 입술을 씹고, 경비원들은 인종적 욕망을 알고 있습니다." # AI Tags
