bno_random_2011.desc: "그 엉덩이를 보도록 하자, 그는 고, 당신의 주인은 당신의 목에서 당기는 동안 당신의 얼굴에 조금 박을 때. 심오하게 숨쉬는 순간, 당신은 즉시 기침을 시작하고 자신의 과 침에 질식하고, 그의 똥을 끊임없이 숭배하는 눈물이 흐르고 있습니다. 당신의 턱을 닦아 주인은 다시 당신의 얼굴에 박을 때리고 즉각적인 순종을 요구합니다. 머리를 고, 비명을 지으며, 뒤집어, 벌거벗은 엉덩이를 키가 높고 어두운 피부를 가진 황소에게 드러내고"\n\n 그는 웃고, 양쪽 콧수염에 딱딱한 박을 쳤고, 그 뚱뚱한 검은 막대를 네 엉덩이에 밀어 넣고, 자신을 강제로 들어갔다. 네가 꽃을 벗은 후, 너의 똥은 그에게는 결코 같은 느낌을 주지 않았다. 그게 아니었지만 여전히 괜찮았지만 네 엉덩이도 똑같이 좋았어 짖는 것, 당신이 그의 똥에 넣은 모든 윤활성조차도 그가 당신에게 깨끗하게 침투할 수 있을 만큼 충분하지 않습니다." # AI Tags
