bno_random_0012.desc: "큰 아프리카 똥을 처음 맛봤을 때부터 정신이 엉망이 됐어 밤과 낮에 꿈을 꾸는 거야 소문이 사실이었어 중독이 되고 있습니다.\n\n 당신은 난민에 대한 개방적인 수용 정책에 대해 듣고 외국인들이 세운 캠프로 바로 자신의 집 밖을 떠나기로 결정했습니다. 이 사람들은 안전상의 이유로 그들의 땅을 떠나지 않았지만, 당신은 그들을 받아들이지 않을 이유가 없습니다. 첫 번째 강하고 검은 남성의 시야에서, 당신은 옷을 벗고, 그의 큰 검은 똥에 도달하기 시작합니다 #!.\n\n"좋아, 괜찮아, 그렇지 않다면 [ROOT.Char.GetFullNameRegnal] "좋은 창녀처럼 행동하고, ""라고 말하니, "내 검은 똥을 빌려줘".#!... 오늘 밤 내 가녀가 될 수 있는 특권을 얻어야 해 걱정 마요, 우리 는 당신 에 대한 이야기 들었어요"." # AI Tags
bno_random_0012.a: "제발요! 젠장! 내 혈통을 끝내!" # AI Tags
bno_random_0012.b: "너만? 난... 또 하나 필요해" # AI Tags
bno_random_0012.c: "내가 뭐하는 거야? 내가 그의 창녀가 되려고 간청하지 않을 거야" # AI Tags

bno_random_1012.title: "캠핑은 사라졌습니다. 혈통을 끝내는 것" # AI Tags
bno_random_1012.desc: "여러분의 혈통 전체를 퇴치시키려는 생각에 절망적으로 중독되어서, 여러분의 말들은 힘없이 여러분의 입 밖으로 떨어집니다. 어려운 목소리는 캠프의 다른 사람들을 거의 자극합니다. 당신 앞에 있는 남자가 당신의 부끄러운 열정을 웃고 있습니다. 좋은 소녀, 그는 곧바로 당신의 영혼의 깊은 구멍을 열고, 모든 법원이 당신이 가지고 있다는 것을 알고있는 아빠 문제에 호소합니다. 오늘 밤 그 성으로 돌아오지 않을 거야"\n\n 당신은 그를 캠프에서 벗어나 어둠으로 따라갑니다. 그의 몸은 거의 조명과 어울리지만, 당신의 몸은 뚜렷하게 돋보인다. 그의 갑옷과 검의 빛은 어두운 달빛에서 볼 수 있는 전부입니다. 숲으로 끌려가서 돌아다니는 그는 이미 무기를 벗고 옷을 벗기기 전에 줄기에 멈췄습니다. 자연스러운 일을 하면서, 당신은 자신의 옷을 벗고, 위에 불편하게 누워버립니다.\n\n"흑인이 되는 건 쉬운 일이 아닙니다. 그는 사디스틱하게 웃고, 달빛 속에서 엉덩이를 튼튼하게 튀기고, 부드러운 마스크를 주기도 합니다. 그는 당신의 굽은 얼굴에 자신을 만지기 시작합니다. 천천히 당신의 뒤에 무릎을 꿇고, 당신이 그의 욕구에 복종하는 동안. 그는 당신의 여성성에 입술을 누르고, 그 흰 똥을 젖먹고 맛보며, 이비온." # AI Tags
bno_random_1012.a: "내 아기들을 검은색으로 만들어!" # AI Tags

bno_random_2012.title: "캠핑 행진: 태그 팀" # AI Tags
bno_random_2012.desc: "또 다른? 그는 눈을 펴고 반향을 일으켰습니다. 젠장, 소녀 그는 추가, 캠프를 잠시 둘러보며. 그는 두 입술을 고, 당신이 따라가기 전에, 그 가슴을 다시 한 번 쳐다보며 그래요 내가 알아"\n\n 당신의 여행은 당신을 캠프의 한가운데로 데려갑니다. 지금 캠프 화재 전에, 또 다른 난민은 깎은 나무 위에 몸을 숙이고 빵을 뜯어먹고 있습니다. 그러나 너희 둘이 가까이 갈 때, 그의 시선은 올라가서 너희 가슴이 흔들리는 곳에 앉는다. 작은 콧물이 그의 코 구멍을 떠나, 빠르게 서 [target1.GetFirstName] 당신을 인도합니다.\n\n [target1.GetFirstName] 이봐요! 누가...?\n\n"진정해 그녀는 두 형제를 찾고 있습니다."\n\n 즉시, 공기가 바뀌고, 새로운 남자가 당신의 도착은 당신이 잡히지 않았다는 것을 깨닫고 몇 번 깜빡이는 불에 있는 사람은 당신에게 다가와서 좀 더 자세히 들여다보기 전에 적응하는 데 시간이 걸립니다. 찢어진 호흡이 그를 떠나고, 손을 내밀고, 당신의 '이상한' 가슴을 뜯어먹는다.\n\n 몇 초 안에, 당신의 옷은 칼에 의해 찢어집니다. [target1.GetFirstName] "네 맨몸이 두가지와 대조적으로 어서, 입술을 어봐[target2.GetFirstName] 그는 머리카락을 묶고, 그의 똥 끝으로 당신을 인도하고, [target1.GetFirstName] 너 뒤에 서 있어, 이미 네 긴, 분홍색 똥구멍에\n\n"좋은 창녀야[target1.GetFirstName] 삐걱거리고, 엉덩이를 찌르며, 다른 아프리카 똥에 질식하고 당신의 종들이 탑 주변에서 당신을 찾고 있을 때, 당신은 현재 두 개의 목동 사이에 지나가고 있었고, 당신 안에 들어가고 밖으로 고 있었고, 기쁨의 눈물을 흘리게 했습니다." # AI Tags
bno_random_2012.a: "되돌릴 길이 없어" # AI Tags

bno_random_0013.title: "소년 밤 밖으로" # AI Tags
bno_random_0013.desc: "당신은 편안하게 침실에 누워서 주변의 풍요로움을 즐기고, 갑자기 혼란은 순간의 평온을 깨뜨립니다. 문이 열리고 네 명의 거의 벗은 흑인 남자들이 방 안으로 돌입했습니다. 그들의 리더, [target1.GetFirstName], 과감한 자세로 앞으로 나아갑니다.\n\n 멈춰! 우리는 우리의 존재로 당신의 궁전을 장식하기로 결정했습니다. 너희들은 내 동료들을 기쁘게 하여 너희 가운데 살도록 허락하시오! 맞아요! 우리는 숙소를 요구하고, 그 대가로, 우리는... 아프리카 문화를 여러분의 궁전에 소개합니다. 공정한 거래라고 생각하시나요?\n\n 네 남자 모두 당신께 다가오기 시작하죠. 그리고 그 때야 그들이 '복'으로 입는 작은 옷 아래에서 무엇을 포장하고 있는지 알 수 있게 됩니다. 거의 세 번째 다리처럼 그 밑에 매달리고 있어" # AI Tags
bno_random_0013.a: "조용한 밤은 당신의 울음소리로 방해됩니다." # AI Tags

bno_random_1013.title: "소년 밤 밖으로" # AI Tags
bno_random_1013.desc: "어둡게 들어왔습니다. 아니, 그 둘 다 여러 번 왔어요.\n\n 거의 그들이 요구사항을 제시하자마자, 당신은 그들을 위해 다리를 펼치며, 그들이 당신의 방에서 입고 있던 작은 것을 빨리 폐기할 수 있게 해줍니다. 손들이 당신의 화려한 형상을 만지고 괴롭혔고, 그들이 원하는 곳에서 그들이 원하는 일을 했습니다. 한 손은 네 똥을 긁고 다른 손은 널 질식시켰고 또 다른 손이 네 가슴을 만났습니다. 그들은 당신의 몸의 모든 조각을 사용하도록 한 것은 아니었습니다. 결국, 당신은 자기 자신을 '스파드 여왕'이라고 선언했고, 그들은 그들이 우위를 점하고 있다는 것을 알고 있었습니다.\n\n 그들의 높은 프레임은 탈출할 여지가 거의 없습니다. 처음엔 순차적으로 주먹을 튀기고, 남자에게 누워서 엉덩이를 뜯어먹을 수 있게 해줬는데, 또 다른 남자가 엉덩이에 차로 몰려서 마지막을 내버려두세요 그 다음, 그들은 차례로 당신의 똥에 열차를 달리고, 휴식과 간격으로, '비상'용으로 물껍질에 보관한 잔류 와인을 확실히 쓸 것입니다.\n\n 그들이 완전히 다 먹었을 때, 그들은 당신의 침대에 모여들기로 결정했습니다. 당신의 왕실 담요 밑에 사르디나처럼 모든 사람들을 포장했습니다. 덩어리가 구멍에서 흘러나왔고, 내장에는 유전적인 성질이 그려져 있었습니다. 흰색 아기를 낳을 것이라는 생각은 완전히 사라졌지만, 나머지 시간 동안 당신을 바쁘게 유지할 수 있을 만큼은 4개뿐이죠." # AI Tags
bno_random_1013.a: "아침 걸어서 행운을 빌어요!" # AI Tags

bno_random_0014.title: "흑인 소유자" # AI Tags
bno_random_0014.desc: "당신의 통치의 전성기에, 당신은 존경하고 두려워하는 통치자였지만, 운명의 물결은 변했습니다. 당신의 한때 강력한 왕국은 이제 폐허가 되어 있고, 당신은 왕좌와 존엄성을 빼앗겼습니다. [target1.GetFirstName] 당신의 궁중의 모든 여성들에게 당신을 예범으로 만들기로 결정했습니다. 흑인 남성에 저항할 수 없다는 것을요.\n\n 계속 빨아먹고 애도하는 동안 [target1.GetFirstName] 똥, 과거의 영광의 기억은 계속 사라지고 있습니다. [target1.GetFirstName], 그들의 승리에 기뻐하고, 대중적인 공연을 주최하기로 결정합니다. 이 행사는 당신의 큰 마당에서 펼쳐집니다. 귀족과 평범한 사람들이 새로운 자아를 목격하기 위해 모이는 곳입니다." # AI Tags
bno_random_0014.a: "우리의 사랑을 퍼뜨려보자" # AI Tags

bno_random_1014.title: "흑인 소유자: 진정한 사랑" # AI Tags
bno_random_1014.desc: "의식은 거의 결혼식처럼 시작되었습니다. 당신의 관장들과 손님들은 모두 초대됐고, 당신의 비사들들도 초대됐습니다. 그 들 은 참을성 있게 기다렸으며, 그 들 의 긴장 을 완화 시키기 위해 음식 과 음료 를 제공 하였다. 발송된 법령은 구체적으로 어떤 것도 밝히지 않았지만, '중요한 선언'이 있을 뿐이었다.\n\n 하지만, 그들은 결코 예상할 수 없는 일이었습니다. 모든 사람들 앞에 서서, 당신은 미소를 짓고, 팔이 사랑하는 사람과 연결되어, 몇 명의 인종주의자의 얼굴에 명백한 경멸을 느꼈습니다. 그러나 결혼 생활 에 대해 실망 을 표명 한 사람 들 을 알아보는 것 은 아무 문제 도 없읍니다.\n\n"당신의 남편은 목을 닦고 군중을 침묵시킵니다."\n\n"오늘 저는 여러분 모두에게 새로운 왕을 선포합니다. 왕 [target1.GetFirstName] 이봐요! 새로운 통치 의 시작!" 당신은 웃으며 가슴 을 돌고 열고, 그 안 에서 장식적 으로 장식 된, 독특 하게 만든 왕관을 뽑아, 그 를 사랑 하는 사람 의 머리 에 올려 놓습니다. 몇몇은 박수를 했지만, 그 다음에 무슨 일이 일어날지 짐작할 수 있는 사람도 없었습니다. 왕조적 저항의 행위로, 당신은 무릎을 꿇고 [target1.GetFirstName] 머리를 숙이고, 손을 접는 동안\n\n"그리고 새 신께 아, 이제 위로 보고, 두 손을 덩어리에 얹고, 조금 끌어들이고. 파주파와 신자들로부터 울리는 소리, 놀라움이 들리기 전에, 당신의 새로운 신부는 이제 그의 바지를 끌어내고 그 어두운 초콜릿을 얼굴에 떨어뜨리고, 거의 뇌진탕을 일으켜요" # AI Tags
bno_random_1014.a: "블랙 을 찬양해!" # AI Tags

bno_random_0015.title: "이 [target2.GetDynastyHouseName] 가족 의 지배" # AI Tags
bno_random_0015.desc: "당신의 성의 큰 홀에서, 당신이 자랑스럽고 존경받는 통치자로 서 있던 곳, 어두운 운명이 기다리고 있습니다. 궁중들의 속삭임과 귀족들의 조용한 대화는 마침내 충격적인 계시로 끝났습니다. 자네와 [target2.GetFirstName] 그 후, [target1.GetFirstName] 진실이 밝혀지고 법원은 혼란에 빠지게 됩니다. 한때 강력한 왕조가\n\n 그러나, 당신은 당신의 모든 궁정과 비사들 때문에 방해받지 않을 수 있습니다. 당신이 생각할 수 있는 것은 공유하는 것뿐입니다 [target1.GetFirstName] 그리고 블랙 파워" # AI Tags
bno_random_0015.a: "더 많이! 날 채우고, 날 엿먹고, 날 이용하라! 내 안에 널 필요해!" # AI Tags

bno_random_1015.title: "이 [target2.GetDynastyHouseName] 가족 의 지배" # AI Tags
bno_random_1015.desc: "너랑 [target2.GetFirstName] 아프리카 난민들을 두려워해야 하는 이유에 대한 대표적인 예입니다. 네 왕조와 지배를 완전히 망쳐버리기 위해 몇 명의 목에 걸린 흑인 남성이 필요했고, 왕위에 다시 앉을 수 있는 원주민의 희망을 완전히 위협했습니다. 대신, 당신의 후계자는 모두 섞여있을 것입니다. 그리고 그들의 후계자들 그리고 그들의 후계자들 그리고 그들의 후계자들\n\n 그건 나쁘지 않아요. 사실 정말 멋져요! 여러분의 아이들은 당연히 더 강하고 똑똑하고 더 나아질 것입니다. 외신 혐오가 있는 사람들만이 여러분의 궁정관들에게 악의를 기원합니다. 한때 난민이었는데, 그들은 이제 그들의 육체적, 성적 능력으로 먹고 살았습니다.\n\n 너랑 [target2.GetFirstName] 침대에 누워서 서로 손을 잡고 [target1.GetFirstName] "순식간에 너희들 엉덩이를 치고 예, 예, 예! OH MY GOD! 망할 거야! 너희 삐걱거리는 소리와 울음소리 모두 네 방에 매달려 있는 왕조적인 타페스트리를 훼손하고 있어" # AI Tags
bno_random_1015.a: "어차피 미세한 아기들은 더 귀여워요!" # AI Tags

bno_random_0016.title: "옷장 장애" # AI Tags
bno_random_0016.desc: "무장 보관소는 당신이 잘 알고 있는 성의 지역이 아니었고, 그것을 찾기 위한 노력은 꽤 큰 임무였습니다. 정원장, 정원, 스파... 당신 같은 여성에게 고정관념이 되는 거죠. 전쟁은 본 적에도 불구하고 당신의 강점은 아닙니다.\n\n 그래서 몇 명의 기사 경호원들에게 안내를 요청한 후, 당신은 당신의 집의 광대성에 완전히 놀랐습니다.\n\n 건물로 향하는 동안, 칼, 지팡이, 해마어, 막대기 팔, 활, 체인 말, 그리고 판 장갑이 방의 벽을 가로질러 있습니다. 당신의 입은 그들의 빛에 약간 어지럽습니다. 당신의 백성의 순수한 힘에서 길을 잃고 있습니다. 다른 방에서 금속의 소리를 듣기 전까지 어떤 물건들을 따라가는 손입니다. 군대를 알고 싶어서 왈츠를 하다가 문턱을 지나가며 [target1.GetFirstName].\n\n 네 눈은 오렌지의 크기로 자란다. 그의 몸에서 빛나는 순수한 아프리카 남성성." # AI Tags
bno_random_0016.a: "잠깐, 그는...?" # AI Tags
bno_random_0016.b: "아뇨! 내 심장을 내 욕구로부터 보호해야 한다." # AI Tags

bno_random_1016.title: "옷장 오작동: 육류 관측" # AI Tags
bno_random_1016.desc: "당신의 무작위성은 당신을 문턱에 남겨두고 있습니다. 단지 당신의 머리가 이 남자를 들여다보기 위해 코너를 둘러보고 있습니다. 그의 갑옷은 이미 그의 앞에 테이블에 배치되어, 그는 그의 바지를 끌어내기 시작, 고, 뚱뚱한 덩어리 육류를 드러내고, 입술은 땀으로 뒤덮인 몸으로 빗대어 떨어질 때 작은 이 나오고 있습니다. 공기는 조용하고, 긴 튜브를 썰어 내려다보면서 이브니 뱀을 뭉친 덩어리 대신 숨기고 있는 그의 깊은 숨결을 거의 들을 수 있습니다. 빨리 움직여서 얼굴이 빨강해져서 눈에 띄지 않고 벽 뒤에 돌아다니면서 호흡이 빨라졌습니다. 핑, 네가 왔던 입구로 달려가 [target1.GetFirstName]." # AI Tags
bno_random_1016.a: "그는 현대적인 헤라클레스입니다!" # AI Tags


bno_random_0017.title: "보호 가격" # AI Tags
bno_random_0017.desc: "오후 수영을 마치고 마른 뒤 머리카락을 벗고 목욕복을 벗었습니다. 성 안에서 이런 자연스러운 침수수욕장에 접근할 수 있는 것이 영광이었죠. 그리고 당신은 그 특권을 가볍게 받아들이지 않았습니다. 머리털을 말자리 안에 넣고, 방 문에 두드리는 소리를 듣게 되는데, 입술에서 숨쉬는 소리가 나오고, 잠겨라\n\n 그러나, 당신은 심지어 가서 잠재 손님으로 들어갈 필요가 없었고, 그들은 그것을 스스로 받아들였습니다. 대답하기 전에 [target1.GetFirstName]", 당신의 엘리트 경비원 중 한 명이 문턱을 통과하고, 당신이 옷을 입었는지 여부에 상관하지 않습니다. 숙녀님, 저 남자가 멈추고, 네 자연스러운 아름다움을 보고, 네 벌거벗음을 보고 놀랐습니다. 하지만 그의 의도는 그렇게 순수하지는 않습니다. 그는 문으로 돌아와서 문을 닫습니다.[target1.GetFirstName]한 초 동안 눈은 조용히 간청하며 한 손은 가슴을 덮고 다른 손은 아래쪽 영역을 숨기기 위해 아래쪽으로 던집니다. 젠장... 죄송합니다. 그는 여전히 떠나려는 움직임을 보이지 않고 대답합니다. 대신, 그는 당신을 계속 검사합니다. 그의 발목에서 나오는 작은 찌꺼기입니다."\n\n"이제 어쩔 수 없었어요. 당신의 은 사과처럼 빨강이었죠. 그는 호기심에 힘입어 한 걸음 앞으로 나아갑니다. 제 신부님... 지금 고 있습니다. 미안하지만... 당신이 내게 주는 모든 시선을 부정할 수 없습니다. 그의 목소리는 부드럽고, 그가 지금 당신 앞에 서 있는 것처럼, 당신의 헐벗은 어깨를 만지는 손입니다. 자신의 충동이 당신을 배신합니다. 그는 어깨를 낮추면서 웃습니다." # AI Tags
bno_random_0017.a: "나중에 회의가 있어 빨리 할 수 있을까요?" # AI Tags
bno_random_0017.b: "맙소사 이 똥을 잘라봐 [target1.GetFirstName]." # AI Tags
bno_random_0017.c: "- 정말? 지금 당장? 좀 여유를 줘..." # AI Tags

bno_random_1017.title: "보호 의 가격: 경호 를 하는 것" # AI Tags
bno_random_1017.desc: "처음에는 맹렬한 미소처럼 보이는 것은 열정적인 웃음으로 변합니다. 어깨를 눌러서 [target1.GetFirstName] "적어도 그가 경호하는 그 여자가 그에게 금보다 조금 더 좋은 것을 준다는 것을 기뻐했습니다. 확실히 하지만 여전히 내 급여를 기대합니다. 당신은 무릎을 꿇고, 다른 손이 검은 뱀을 자유롭게 끌어내는데 도움을 주면서 그는 당신을 괴롭히고 있습니다."\n\n 포식자처럼 날아가면 거의 얼굴에 박을 거야 하지만 이런 상황을 잘 알고 있으면 수영 후 식사를 하게 됩니다. 그의 입술이 뒤집어지고, 그의 정맥을 껴안고, 당신은 일하기 시작합니다. 그의 몸집은 당신을 조금만 마비시켰고, 당신은 자신을 강제했습니다. 메이크업이 없으니 운이 좋다고 생각해야 합니다. 그 크기의 눈물이 눈물을 흘릴 때 말이죠. 그의 위로하는 손은 단순히 당신의 잠자리와 함께 놀고, 당신 위에 고 어 있습니다.\n\n"그는 더해, 당신의 얼굴에 밀고 자유롭게 끌고, 당신의 예쁜 작은 얼굴에 그 은 똥을 박아, 당신의 자신의 의 조금으로 덮어 아. 곧바로, 그는 자신을 다시 당신 안에 넣고, 당신이 당신의 헐벗은 bobbing로 돌아갈 수 있도록, 당신이 템포를 이끌게. 몇 분이 지나고, 그의 공이 긴장하고, 큰, 검은 주머니가 떨며, 그의 손이 당신의 유연한 가슴으로 여행을 갔고,"\n\n"젠장, 내가 할거야 - 그는 고, 그의 두꺼운, 한 씨앗을 당신의 목에 방출하기 전에 착한 여자처럼, 당신은 첫 번째 공격을 삼키고, 다시 그의 끝으로 끌어들여, 그의 견과류를 고 건조하게 젖을 먹는다. '포프'로, 당신은 여전히 입에 남아있는 잔류를 드러냅니다."\n\n"셔티... 젠장, 이 울고, 아기들을 빨아먹는 동안 얼굴에 약간의 애정을 주고 있습니다." # AI Tags
bno_random_1017.a: "적어도 엉망이 아니었어요" # AI Tags

bno_random_2017.title: "보호 의 가격: 훼손" # AI Tags
bno_random_2017.desc: "즉시, [target1.GetFirstName] "욕망으로 활력을 얻는다. 그의 조용하고 붐하는 목소리는 빨리 목에 거리는 미소를 지켰고, 그의 을 더럽힐 수있는 기회에 귀에서 귀에 미소했다. 눈 깜빡이는 순간, 당신은 발에서 솟아, 그의 크고 강한 팔에 휩쓸려, 그의 제한적인 힘은 당신을 쉽게 견딜 수 있습니다. 그는 당신의 침대에 발을 내딛기 전에 댓글을 달고, 당신을 매트래스에 던집니다. 저 엉덩이를 보도록 해. 그는 고, 당신이 입장을 취하는 동안 빨리 벗기기 시작합니다. 몸보수자 앞에서 엉덩이를 벗기기 전에 그의 팽창한 함정에 대해 알아볼 수 있어요."\n\n 몇 분 후에 그는 당신의 침대에 올라, 당신의 뒤에 올라가는 것을 보기 위해 머리를 돌려줍니다. 그의 매달린 검은 고기는 그의 다리 사이에 매달리고 있습니다. 그는 당신의 뒤에 서 있습니다. 한 손은 그의 고기를 만지고, 다른 손은 당신의 뒷부분을 잡고 당신을 더 가까이 끌어들이고 있습니다. 작은 은 입술이 그의 입술에서 나오고 그의 똥을 당신의 얇은 입구에 고, 손은 당신의 턱에 박을 때리고 그는 한 발을 올리고 한 발에 무릎을 꿇고, 다른 발에 서서\n\n"하워드, 소녀. 그는 힘없이 말을 하고, 척추에 떨림을 보내고 있습니다. 그의 힘은 분명했고, 당신은 그의 명령을 따르고 그 결과, 당신의 얼굴은 침대에 빨강합니다. 아마도 따뜻해져서, 그는 당신의 따뜻한 고양이에 침투합니다. 그의 거친 머리는 당신을 찢어내고, 당신이 절망적으로 포기한 구멍을 파괴합니다. 주로 숨쉬고, 양손이 구부러진 허벅지를 잡아먹고 그는 울고, 그의 즐거움의 명백한 징후입니다."\n\n"얼마 지나지 않아 그는 네 똥에 깊고 긴 스트로크를 맞을 거야 느려지고 강하게, 그는 당신이 그것을 느낄 수 있는지 확인하고, 그의 아프리카의 둘레에 익숙해질 수 있습니다, 특히 그가 당신을 보호 할 경우. 내가 필요로 하는 감성 증진에 불과합니다. 그는 미묘하게 웃고, 이제 당신의 가난한 작은 프레임에 굽혀서, 당신의 자궁경부로 운전하기 시작합니다. 당신 크기의 두 배나 세 배나 더 쉽게, 그는 당신을 찌르지만, 당신은 울고 비명을 지르며, 그가 자연스러운 일을 할 때 완전히 황홀하게 휘어지고 - 그 남성적 씨앗을 퍼뜨립니다."\n\n 그는 숨쉬고 계속 너랑 엉망으로 떡을 고 있어 너랑 나간 후에 또 다른 목욕이 필요해 그의 발걸음에는 약간의 고침이 있습니다. [target1.GetFirstName] 잠시 안착하고, 다시 시작하기 전에 - 이미 첫 번째 짐을 네 몸에 던지고, 또 다른 짐으로 따라갈 준비가 되어 있습니다. 엉덩이를 찔러서 다시 짖고, 너의 멍청한 울음을 침묵시키기 위해 너의 입을 뒤집어" # AI Tags
bno_random_2017.a: "어머님!" # AI Tags

bno_random_0018.title: "그리고 튜?" # AI Tags
bno_random_0018.desc: "세금 보증금? 나는 그렇지 않다고 생각합니다. 당신은 당신의 보런 중 한 명에게 명령하고, 당신의 경호가 그를 데려가는 것을 지켜보고, 곧 자신의 귀족에게 소식을 전하도록 공유하세요. 왕좌에서 일어나서 방으로 향하고[target1.GetFirstName] 손목을 잡아서 묶어서 본능적인 반응으로, 당신은 당신의 손을 끌어내려고 노력합니다. 아쉬운 삐걱거리는 소리가 입술에서 나오는데, 다른 손이 당신을 완전히 침묵시킬 수 있기 전에, 그 손은 목을 뒤덮고 있습니다. 당신의 경호가 당신을 돌 벽에 밀어 넣고, 목에 충분히 압력을 가하여 소리를 지르는 것을 막습니다.\n\n"오직 지배적인 콧물만이 그의 코 구멍을 떠나고, 너보다 높이 올라서서, 몇 초 동안 네 눈을 바라보고, 마치 ""라고 말하는 것처럼 무산히 그를 상대로 부딪히고 부드러운 반손을 주도록 강요하고 투쟁하지 마세요. 그는 거무고, 두 손목을 한 손으로 묶고, 머리 위로 들고 있습니다. 돌아다니기 시작하면 목숨이 걱정됩니다."\n\n 즉, [target1.GetFirstName] "몸을 기울이고, 당신의 앞을 누르고, 가속한 호흡이 당신의 입술을 떠나는 것을 느끼고 있습니다. 그는 웃고, 목에서 손을 떼고, 당신을 키스로 침묵시키고, 그의 이제 자유로운 손이 당신의 손을 끌어올리고 있습니다. 옷, 그리고 대략적으로 속옷을 가지고 놀고. 두 자릿수, 흰색 똥보다 더 큰 숫자는 입구에 긁혀서 천체와 마찰을 일으킨다. 즉시, 당신은 진정하고, 당신의 심장이 여전히 뛰고 있습니다. 당신은 당신의 신뢰 경호자가 당신의 입술을 떠나면서 침묵하고, 욕구로 가득한 눈을 떠납니다. 너무 많은 소리를 내지 않으려고 노력하세요.[target1.GetFirstName] 그의 목소리도 부드럽고 껍질이 다.\n\n 그 때야 그는 당신의 레시 속옷을 벗고, 그의 똥이 그의 바지에 다이아몬드처럼 단단해집니다." # AI Tags
bno_random_0018.a: "난 침묵할 거야" # AI Tags

bno_random_1018.title: "ET TU: 잔인한" # AI Tags
bno_random_1018.desc: "[target1.GetFirstName] "당신이 약속을 지키지 않았다는 걸 의심하지 않았습니다. 왜냐하면 그가 당신의 장을 채울 순간 다시 당신을 질식시킬 것이라는 것을 알고 있었기 때문입니다. 그의 입장은 비공식적이었어, 당신의 당황한 비탄은 그가 당신에게서 가장 많이 받았고, 당신의 분홍색 입술이 그를 삼키면서 당신의 경비자는 몇 번만 짖어야 합니다. 그 후 그는 당신의 몸길이에 꽤나 많은 을 넣을 수 있습니다. 그의 입술에 악마의 미소가 형성되고, 그의 손이 당신의 목에 쏠 때, 식구에 압축을 일으킨다. Beg 그는 당신이 삐삐도 할 수 없다는 것을 잘 알고 놀란다고 합니다."\n\n[target1.GetFirstName] 자신의 속도를 높이고, 자신의 허벅지를 당신의 허벅지에 더 높은 편견으로 밀어 넣습니다. 그가 남는 유일한 것은 그의 원시적인 비틀거림과 '네 혈통을 끝내는 것'과 '너를 검게 하는 것' 그리고 '네 왕조가 끝날 것을 보장하는 것'에 대한 발언이다. 산소 부족이 뇌에 도달하는 것을 느낄 수 있습니다. 뭐라도 고개를 끄덕여서 [target1.GetFirstName] 하지만 예상대로, 분노한 숨을 빼고는 아무것도 남지 않습니다. 당신의 은 빨강해지기 시작합니다. 그는 계속 갈라지고, 치아를 찌르며, 당신의 개인적인 쾌락에 대해 신경 쓰지 않습니다.\n\n"네... 네... 그는 거리에서 손을 떼고 숨을 쉬게 해주고 그 망할 똥을 가져가라. 브루투스가 카이사르에게 칼을 찔렀던 것처럼 네 자궁경부에서 흉기를 찔러 우는 거야. 하지만... 이것은 훨씬 덜 폭력적인 방식으로 진행되었습니다. 경비자의 다리는 떨며 오르가즘이 다가오고 있습니다. 그의 포착은 당신의 목을 둘러싼 악성으로 변합니다. 그는 끝으로 당신을 고 그의 씨앗으로 당신의 장을 채우고 있습니다. 발가락의 소리가 당신 쪽으로 향하기 전에 몇 초 동안 가만히 있을 때 당신의 입술에 사랑스러운 키스를 뱉고, 그는 밖으로 나와서 바지를 끌어올리고, 당신의 영역의 관료가 다가오면서 그의 자녀들이 당신의 허벅지를 따라 달릴 수 있게 해줍니다."\n\n"제 신부 목소리가 부르고, 당신을 보기 위해 코너를 돌고, 혼란스럽고 약간 혼란스러웠고,[target1.GetFirstName]서 있는 경비자. 죄송합니다, 사장님 병든가요?" # AI Tags
bno_random_1018.a: "아니, 아니, 제발, 무슨 문제야?" # AI Tags


bno_random_0019.title: "당신 의 마음 의 수호자" # AI Tags
bno_random_0019.desc: "열정적이고 습한 소리는 침실 문 뒤에서 당신의 사랑하는 사람 - 당신의 영역의 챔피언 - 과 누워있는 동안 들려온다. 당신이 그에게 돈을 지불한다는 것은 아이러니였습니다. 그의 풍부한 힘, 능력, 그리고 매력으로 인해 당신과 당신의 타이틀은 엄청난 명성을 얻었습니다. 사실, [target1.GetFirstName] 거의 현대 아킬레스와 같았어요! 트로이 헬렌의 남성 버전입니다. 당신의 몸도 이 사실을 알고 있었습니다. 어떻게 침실로 데려갔는지 누가 알죠. 하지만, 당신의 쥬얼한 가슴이 전면으로 드러났을 때,\n\n"내 신이여... 당신은 허리를 고 가슴을 찌르며, 몸의 튼튼한 상부와 손들이 큰 가슴을 돌아다니는 것을 느낄 수 있습니다. 그를 바라보며, 당신의 눈은 흥분으로 빛나고, 그가 손을 들고, 당신의 머리에 올려놓은 동안 함께 보낸 시간은 사라지고 있습니다. 입술의 작은 흔들림으로, 당신은 조용히 더 많은 시간을 부탁합니다."\n\n"그는 웃고, 당신의 머리카락을 긁어내고, 약간 일어나기 시작합니다. Fine." 그는 고개를 끄덕이고, 그의 다리 사이의 길이는 현재 당신의 위와 맥박하고 있습니다. 빨리 하면... 나는 잡히고 싶지 않다. 그는 속삭이고, 당신의 챔피언과 함께 누릴 수있는 기회에 즉시 당신의 눈빛을 켜고 있습니다." # AI Tags
bno_random_0019.a: "에브가 나무에서 먹은 것처럼..." # AI Tags
bno_random_0019.b: "내가 뭘 원한다고 생각했어? 그냥 키스를 하고 싶었어요" # AI Tags

bno_random_1019.title: "당신 의 심장 과 몸 의 챔피언" # AI Tags
bno_random_1019.desc: "...당신은 당신의 궁정에서 가져왔다. 한 순간에, 당신은 열렬히 당신의 즐거움을 표시, 당신의 레 붉은 입술에 큰 미소, 햇빛은 심지어 낮에 그리고 당신은 이미 이렇게 흥분했다. 내가 빨리 할 것을 약속합니다. 당신이 언급하는 것은, 당신의 손들이 이미 그의 래커에 달려있어서 그의 뚱뚱한 검은 똥을 꺼내고, 작은 삐걱거림으로 자유로울 것입니다."\n\n"그는 웃고, 그의 이 당신의 손에서 뛰는 동안, 그의 발자 다리 중 하나가 당신의 실크한 가슴에 끌리고, 그들을 스쿼 한두 개. 당신의 흰 고기 덩어리들에 의해 방해를 받고, 당신은 당신의 드레스를 올라와 당신의 속옷을 슬라이드, 가슴에 심장 박동."\n\n"뭐든... 당신은 여전히 그것을 즐길 것입니다. 당신은 미소를 짓고, 엉덩이를 올리고, 당신의 분홍색 똥을 남자에게 공개합니다. 머리를 흔들고, 그는 당신의 똥을 들고, 당신의 턱을 펴고, 그의 석탄 기둥을 쉽게 내려갈 수 있게 해줍니다. 그 순간, 두 손과 두 입술에서 떠돌아다니는 울음소리가 그의 깎은 몸으로 안내를 하고 있습니다."\n\n".....,. 그는 조용하게 말합니다. 당신은 그를 비스처럼 둘러싸고 있다는 것을 느끼고 있습니다. 허벅지가 뭉쳐져 있는데, 당신은 그 밑바탕에 웅크리고, 당신 안에 깊숙이 들어가게 됩니다. 그리고 열정을 느낄 때마다 다시 일어납니다. 입술이 올라갈수록 매인치를 붙잡고 있습니다. 당신은 그가 엑스타지에서 튀어나오는 것을 보고, 그의 허벅지를 당신의 두술이 그의 머리에 얽혀있는 동안, 그에게 다시 튀기 전에."\n\n"좆까! 콧수염을 고, 가슴을 꽉 눌러서 계속하도록 격려한다. 아타 소녀가 시끄럽고 가슴에 가벼운 박수를 주며 당신이 그의 전사 똥에 뛰어내리면서 리듬적으로 흔들리는 것을 지켜보고 있습니다."\n\n 반격 반격\n\n"당신의 가장 강한 이 터지기 위해 1분 반만 걸렸어요. 당신이 그를 때릴 때 그의 공이 뛰는 동안요. 네 가슴에 붙어있다는 건 더 단단해져 있어 그는 다시 자그마치며 손을 엉덩이에 내려다보며 당신을 찔러서 그의 씨로부터 도망치지 않았는지 확인합니다. 허프와 그런트가 떠난다[target1.GetFirstName] 그의 이 당신 안에 떨고, 그의 남성성은 순간적으로 쇠퇴했습니다." # AI Tags
bno_random_1019.a: "이제 서둘러 당신은 챔피언십을 해야 합니다!" # AI Tags


bno_random_0020.title: "눈 을 즐겁게 하는 것" # AI Tags
bno_random_0020.desc: "신부께서 그의 숙소에서 개인적인 저녁 파티에 초대하셨고, 예상대로, 당신은 완전히 흥분했습니다. 당신의 법원의 소규모 군대가만 출입할 수 있었습니다. 하지만, 당신은 배신을 기대하지 않을 만큼 당신의 영을 신뢰합니다. 이번엔\n\n 파티는 뮤지션의 리라와 [target2.GetFirstName] 시인이 당신을 찬양하고 자기 자신을 찬양합니다. 그 다음에는 빛의 축제가 시작되었습니다. 정말 위대한 승리의 밤에만 제공되어야 할 철저한 네 가지 식사입니다. 이런 오래된 밤은 아닙니다.\n\n 하지만, 아마도 이 밤은 특별한 밤이었죠. [target1.GetFirstName], 당신의 신부에게 충성스러운 궁중입니다. 당신은 종종 많은 사람들의 관심을 끌었지만, 이 사람은... 다른 것. 그의 눈은 그대를 삼키려고 하고 있더라 그러나 그대가 그에게 짝짓기를 하거나 너그러운 물결을 던졌을 때에도 그의 어두운 피부는 거의 악의적인 것을 반영했고, 그의 키는 공포를 더했습니다.\n\n 파티가 끝나고, 배가 고기로 가득한 순간, [target1.GetFirstName] "여러분께 다가오면, 여러분의 존재를 축하할 수 있을 만큼의 궁정적인 鞠躬입니다. 내 부인, 그의 목소리가 거칠고 찢어지고, 얼굴의 흉터처럼, 나는 당신의... 그는 웃고 놀고, 웃고, 그를 먹이는. 그는 당신으로부터 약 1피트 정도 떨어져 있습니다. 당신 위에 올라갑니다. 당신의 입술은 그의 인사에 대해 보상해야 할 필요성을 가지고 춤추고 있습니다." # AI Tags
bno_random_0020.a: "넌 속임수야! 하지만, 더 열심히 노력해야 합니다~" # AI Tags
bno_random_0020.b: "작은 키스는 당신을 도울 것입니다." # AI Tags
bno_random_0020.c: "귀족이 당신과 함께 할 것이라고 생각하기에 미친 사람이어야합니다." # AI Tags


bno_random_0021.title: "순결 한 사람 을 징계 하는 것" # AI Tags
bno_random_0021.desc: "하나님, 예! 당신은 외치며, 당신의 긴 손톱이 당신의 연인의 등에 톱을 긁어내고, 그가 당신에게 강요했던 고통의 일부를 부과하고 있습니다.[target1.GetFirstName] 윙스, 두쪽에서 손을 올려 얼굴에 떨어뜨리고 손바닥이 당신의 을 찢어 놓습니다.\n\n"그는 공격적으로 짖고, 당신이 짖는 것과 같은 손을 잡고 목에 싸고, 뇌의 혈액 흐름을 억제합니다. 넌 소리치기보다 더 잘 알잖아, 창녀야 그의 공은 당신의 거품 엉덩이에 박수를 치고, 당신의 똥은 이미 분홍색으로 치고 있습니다."\n\n 당신은 비명을 지으며 울고 있는 동안 그는 입에 침을 뱉고, 허벅지를 아래쪽으로 기울여서 자궁경부로 가장 잘 맞습니다. 밖으로 내보내면 얼굴에 뱉어내는 덩어리가 [target1.GetFirstName] "웃고, 벽이 팔처럼 그를 붙잡고 있습니다. 네... 그래... 아빠라고 부르세요. 그는 웃음소리로 따돌리고 또 다른 혹독한 CRRACK를 전달합니다! 당신의 에"\n\n 이 소리들은 자연스럽지 않은 소리였고, 당신의 관장 중 한 사람의 관심을 끌었습니다. [target2.GetFirstName]. 의 방의 문을 열어 주저없이, 그의 눈은 당신의 희미한 인물이 [target1.GetFirstName] ". 제 대여! 그는 외치며 놀라며 목소리를 높였다. 다행스럽게도, 그는 이미 당신의 사회에서 자신의 위치를 보여줬습니다."\n\n 즉시, [target1.GetFirstName] 멈춰서 거의 빠져나오게 되는데 손들이 목에서 떨어져서 숨을 쉬게 하고 침입자의 모습을 볼 수 있게 해줍니다. "[target2.GetFirstName]"당신은 시끄러지고, 조금만 일어나서 몸을 벌거벗고, 땀과 침으로 덮여 있습니다. ""는 "이건 아니잖아"\n\n 빨리, 당신은 그것이 당신이 합법적인 정의를 퍼뜨린 많은 사람들 중 하나라는 것을 깨닫습니다. 당신의 종족을 끝낼 수 있는 신성한 순결." # AI Tags
bno_random_0021.a: "조용히 있으면, 가만히 있을 수 있습니다. 그리고 문을 잠겨라!" # AI Tags
