bno_random_0022.title: "흑인 신 의 소문" # AI Tags
bno_random_0022.desc: "주간 여러분 이 영토 의 성전 을 방문 하는 '순례'은 항상 유익 한 일 이 되고, 목 에 달린 분자리와 목걸이가 매달려 있는 십자가 목걸이는 항상 여러분 에게 좋은 예언 을 하는 것 같습니다. 하지만 교회에 도착하면 더 어두운 피부를 가진 난민이 돌아다니며 거론을 하고 있는 것을 발견하게 됩니다. 사실 그 사람에게 관심을 기울이는 사람은 아무도 없지만, 당신의 무한한 호기심으로, 당신은 그에게 접근합니다.\n\n"그가 가까이 갈 때, 그는 당신에게 다가옵니다. 그를 둘러싼 이상한 모습. "하나님은 흑인입니다!" 하느님은 흑인입니다! 그는 소리 지르며, 당신의 눈은 그의 부끄러움없는 모욕에 니다."\n\n"큐오씨 이봐요! 제발, 진정해! 당신은 머리를 흔들며 그를 간구합니다. 거의 순식간에 당신의 진정성 있는 목소리에, 그는 자신을 릴러, 그의 미친 외모는 가라앉아, 당신이, 아쉽게도, 그를 엔터테인먼트한다는 것을 깨닫습니다. 무슨 뜻인지 물어봐요?"\n\n 내 말은... 너희는 그리스도가 어디서 왔는지 알지 못하느냐? 예루살렘에서 왔어? 그는 사하라 사막과 이집트 혈통입니다! 이스라엘 사람들은 내 조상이었다." 그는 거의 자신의 진술에 훈련되어, 마치 그것이 그의 삶의 목표인 것처럼 말합니다." # AI Tags
