bno_random_0030.title: "히포크라테스 맹세" # AI Tags
bno_random_0030.desc1: "그리고 이제, 당신의 하위 지역, 제 신하.[target1.GetFirstName] 그의 목소리에서 약간의 의문의 목소리, 그의 눈은 쾌적하게 당신을 바라보고, 지금까지, 당신의 신체에 대한 존중. 그는 이미 당신의 몸의 대부분을 분석해 덩어리, 부상을, 흔적을 확인했습니다 당신은 심지어 의사가 당신의 가슴을 분석해 보도록 제안했습니다. 모든 것이 정상적으로 작동하는지 확인하기 위해서요. 하지만 이제 그는 여성과정 검사를 해야 했고, 존경심 있게 해야 했습니다.\n\n"물론 [target1.GetFirstName]. " 당신은 대답, 테이블에 앉아, 당신의 손들이 당신의 드레스의 턱을 끌어 올리고. 무관심없이, 당신은 당신의 개인적인 부분을 공개합니다. 톱니바닥에 숨겨져 있습니다. 즉시, [target1.GetFirstName] 내쪽 thigh에서 약간의 학대를 볼 수 있습니다. 하지만, 그는 당신이 속옷을 끌고 다리를 펼치면서 기다리고 있습니다.\n\n" Hmm... 그는 당신의 음모를 깊이 들여다보기 위해 묵상하고, 눈을 깜박이고, 기울이고 있습니다. 부드럽게, 그는 틈을 찌르고, 당신의 입구를 찢어, 그리고 확실히 남아있는 작은 흰색 '물질'이 자유롭게 dribbling 알아. 구핑, 그는 신비한 액체에서 표면을 닦아, 당신의 시야에서 그것을 하는. 그는 조금 더 오래 머무르며 손가락을 한 번 넣고, 당신의 몸에 이상한 감각을 보내고 있습니다. 마침내, 그는 물러나서 천장에 손을 닦았다."\n\n"제 부인, 그는 당신의 입구로 내려다보며, 다시 당신에게 돌아와서, 당신은 꽤... 저 아래에서 활동하고 있습니다. 적어도 형제들이 맞을 수 있게 해줬어, 그렇지?" # AI Tags
bno_random_0030.desc2: "그리고 이제, 당신의 하위 지역, 제 신하.[target1.GetFirstName]그의 목소리에 약간의 의박이 있고, 그의 눈은 쾌적하게 당신을 바라보고 있습니다. 지금까지, 당신의 신체에 대한 존경심. 그는 이미 당신의 몸의 대부분을 분석해 덩어리, 부상을, 흔적을 확인했거나 전염병이나 근본적인 상태를 나타낼 수 있는 모든 것을 확인했습니다. 법원의 의사는 당신의 가슴에 대한 잠재적 분석을 할 것을 제안했습니다. 하지만 당신은 거절했습니다. 어느 정도 온도를 유지하려고요. 하지만 이제 그는 여성학적 검사를 해야만 했습니다."\n\n"그... 물론, [target1.GetFirstName] "당신은 테이블에 앉아, 자신을 조정, 대답. [target1.GetFirstName] 귀찮게 다가와서 드레스를 들어 올리고 승인을 구하고 당신이 주먹을 숙여서 드레스의 밑에 완전히 접근할 수 있게 해줍니다. 몇 초 안에, 그는 당신의 하위 영역을 공개합니다. 보수적인, 흰색 속옷의 한 쌍이 당신의 똥을 숨기고 있습니다. [target1.GetFirstName] 천천히 손을 내밀고 다시 당신을 바라보고 있습니다.\n\n"제가 할 수 있을까요? 그가 묻습니다. 어느 쪽으로, 당신은 주먹을 숙이고, 그는 빨리 당신의 속옷을 끌고, 당신의 똥을 드러냅니다. 그는 단지 몇 초 동안만 머물고, 굽히기 전에, 그리고 짧은 충격을 주면, 당신의 '지역'은 꽤 건전한 것처럼 보입니다. 좋아 보입니다. 그는 댓글을 달고, 실수로 당신의 입술을 칭찬합니다. 다시 끌어올려서 드레스를 다시 넣고, 그는 머리를 숙이고 있습니다. 모든 게 잘 보여요, 제 신부"\n\n 귀 기울여서 얼굴이 붉어지고 빨간색이고 여전히 그의 행태에 조금 혼란스러워합니다. 그래도 호기심이 널 끌고 있어" # AI Tags
