bno_random_1030.title: "히포크라테스 서약: 해체학 교훈" # AI Tags
bno_random_1030.desc: "[target1.GetFirstName] "눈물을 펴고, 갑자기 관심에 놀랐습니다. 남자의 해부학? 그는 의문을 제기하고, 눈에 보이는 덩어리를 내려다보며, 그리고 당신에게 돌아와서, 당신의 호기심이 당신의 얼굴에 열광적으로 나타났습니다. 음, 검은색의 해부학은 흰색과는 약간 다릅니다. 그는 카운터에 누워서, 그의 눈이 조금 찢어졌습니다. 내 말은, 내가 자유롭게 sho-"\n\n"부탁드립니다. 다시 말해주세요. 당신의 눈은, 도인처럼,[target1.GetFirstName], 조용하게 그에게 자신을 보여주기 위해 간청합니다. 아니면 적어도 '남자의 해부학'을 설명하기 위해서죠.\n\n[target1.GetFirstName] "스카프, 입술에 미소를 짓고, 엉덩이에 손을 얹고, 바지에 엄지손가락을 뚫고 서서히, 그는 그의 긴 바지를 내밀기 시작, 그의 바지에 그의 긴 박스 느낌. 좋아... 그는 후퇴하고, 그의 바지를 다리 아래로, 그의 트렁크[bno_bbc|E] 노출되었습니다. 그의 정맥이 튀어나와 그의 석탄 기둥 아래로 drip, 천천히 더 많은 그의 둥근 나무를 드러냅니다. 분명히 어렵지 않습니다. 그는 톱에 가까워지고 있습니다. 분명히 색이 변합니다. 당신을 보고, 그는 웃으며, 당신의 표현이 자유롭고 느슨하고 무겁게 반짝이는 것을 보고 변화합니다.\n\n 당신은 소리없이 숨쉬지 않지만 당신의 입이 열립니다. [target1.GetFirstName] 스틱. 이 방은 조용해져 있고, 의사의 손은 뒤로 물러나서, 짜증나게 박을 때리고, 손가락이 그의 똥을 따라다니며 똥이 올라가는 걸 지켜볼 수 있게 해줍니다. 초에 초에 그의 발기 조직이 굳어지고 서서히 기보다는 굳어진다. 뚱뚱하고 육색, 카카오색의 닭은 당신 앞에 빛나고, 그 닭의 바지에 다시 꽂히기도 합니다.\n\n"이제... 당신의 반사기에 대해" # AI Tags
