bno_random_0032.desc: "아드레날린은 누군가의 신발이 성의 동굴으로 이어지는 돌의 계단으로 내려가는 소리를 들을 때 다리를 쏘아 올립니다. 작은 미소는 당신의 입술과 가슴에 심장 박동을 가져옵니다. 당신이 올바른 방식으로 자신을 꾸미려고 노력하는 동안. 당신은 완전히 벗고 있습니다. 화려한 불꽃의 조명 속에서 당신의 희미한 모습, 테이블을 가로질러 덮여있으며, 두 손 모두 작은 포로 차에 묶여 있습니다. 천장까지 어떻게 거기 갔는지 전혀 몰랐어요. 다리가 부분적으로 펼쳐져있어요.\n\n 계단에서 나오는 빛이 예상보다 더 밝아집니다. [target1.GetFirstName] 그의 도착은 그를 위해 모든 것을 정리했습니다. 결국, 그는 용기 때문에 보상을 받을 자격이 있었고, 당신의 몸은 그가 받을 수 있는 대접이 될 것입니다. 아래쪽 입술을 물으며, 당신은 높은 인물이 계단을 내려가며 통로를 통해 감옥으로 내려오는 것을 보고 있습니다.\n\n 곧 만나게 될 거야 [target1.GetFirstName] "그의 얼굴, 그가 가지고 있던 불꽃에 의해 강조, 그의 입술에 미소. "!" 제발! 내버려두세요! 당신은 울고, 묶여있는 사슬에 맞서 싸우고, 분명히 두려움을 연기하고 있습니다. 이 울리는 소리가 동굴 전체에 울려 퍼져 있습니다. 당신 앞에 있는 남자는 여전히 천천히 다가오고 있습니다."\n\n"좋아,좋아 그는 댓글을 달고, 사자처럼 네 앞에 서서, 너를 찢어 버릴 준비가 되어 있다. 여기서 무슨 일이 일어나고 있습니까? 그는 말 그대로 묻고, 불꽃을 태우고, 사악한 미소리로 당신 앞에 올 것입니다. 덫에 걸린 작은 스노우니? 너무 탐욕적이 되세요? 그는 웃고, 그의 한 손이 당신의 발에 달려, 부드러운 마사지를, 그것을 포기하기 전에 Y. 두 손가락이 팔꿈치 위에 휘어다니며, 당신이 휘어지는 것을 보고 있습니다. 자기 자신을 묶고 무력하게 행동하면 내가 인상적일 거라고 생각하십니까?[target1.GetFirstName]다른 손이 다리 사이에 떨어지고, 그의 명백한 콧물 발자국을 가혹하게 만듭니다. 그는 시끄럽고, 거의 뱀처럼 몸을 붙잡고, 엉덩이를 끌고, 당신을 끌어당깁니다."\n\n 순종적으로, 당신은 테이블에서 내려가 추운 단단한 바닥에 서서, 당신의 톱니바닥에 서야 합니다. [target1.GetFirstName] "당신을 이끌고, 테이블을 치고, 순수한 타락에 서게 해줍니다. 그놈은 꼬박거리고 엉덩이에 부드러운 박수를 주며 눈은 네 맨몸을 다. 좋은 노예가 웃고, 당신의 몸이 미래에 대한 보상을 지불할 준비가 되어 있습니다. 그의 손은 또 다른 턱으로 당신의 엉덩이에 떨어지고, 그는 당신의 뒤쪽을 찌르며, 그의 붓을 당신에게 깎아 내리는 동안, 당신이 을 강요합니다."\n\n"이제 착한 여자아이가 되어 조용히 해" # AI Tags
