bno_random_0035.desc: "당신은 숨을 쉬기 위해 숨을 붓고, 당신의 턱은 당신의 두꺼운 목말에 완전히 젖어 있고, 일부는 심지어 당신의 우유 흰 유방의 넓은 범위까지 비추고, 그들을 빛나게 합니다. 당신의 침실의 헐벗은 빛. 공기를 숨쉬고, 눈은 모두 비어, 얼굴은 눈물로 흐르고, [target1.GetFirstName] "네 앞에 서 있고, 아직 짝짝이 없이 그의 똥을 만지고 있는데, 그의 윗부분에서 유전적 데이터가 유출되고 있습니다. 젠장, 이 고, 젖고, 빛나는 똥을 닦아 내 얼굴에 닦고, 네가 회복하는 동안, 너의 방탕한 머리에서 완전히 분노하고. 더 강한, 더 어두운 의 웃음, 그의 씨앗의 일부 당신의 머리카락에 어, 확실히 당신이 나중에 오늘 밤 청소하기 위해 엉망이 될 것입니다."\n\n"" 어머... 당신이 행복할때까지, 당신은 을 고, 이 그의 쪽으로 날아다니고, 당신의 빛나는 입술에 작은 미소를 짓습니다. 그는 당신을 장난감처럼 사용해서 끝냈지만 당신은 여전히 당신의 스파이 마스터였던 질된 야만과 로맨틱한 관계를 느꼈습니다. 분명 그가 마땅히 맡은 역할이야[target1.GetFirstName] 웃으면서 웃게 되죠. 그리고 머리에 달려서 머리를 묶고 머리를 위로 끌어 당기기 전에 즉시, 당신은 시끄럽게, 이 갑작스러운 힘의 표시가 당신의 심장을 떨어뜨리는, [target1.GetFirstName] 당신이 발에 올라가는 동안 당신을 쳐다보고 있습니다.\n\n"꼬마 마녀야[target1.GetFirstName]다른 손을 들어서 가슴을 찌르며 고 은 돼지처럼 울고 울고 내 말 들어봐, 창녀. 그는 을 잡고, 당신의 눈을 똑바로 들여다보게 하고, 그의 pupils의 불꽃이 certain. 내가 네가 하는 일을 알고 있다. 그는 말하며, 입에 뱉어내기 전에, 네 얼굴에 구덩이를 꽂고, 너를 완전히 쓸모없다고 느끼게 해준다. 그의 다른 손은 당신의 젖은 하위 영역으로 내려가며, 짧은 마스크를 주고, 당신의 수분을 모으고 있습니다. 그리고 난 그냥 흑인을 말하는 게 아니야. 그는 웃고, 그의 빛나는 이 우월한 인종의 당신의 노예를 떠올리게 한다. 하지만 다른 물건은 그는 속삭이고, 몸을 기울이고, 당신의 입술에 젖은 주유와 함께 손가락을 꽂기 전에, 당신의 입을 경계에서 위로를 찾을 수 있도록 h."\n\n"당신은 고개를 끄덕이고, 그가 당신을 쳐다보는 동안 손가락에 젖을 붓습니다. 제가 보기엔...[target1.GetFirstName] 손가락을 자유롭게 끌어내서 배에 긁어 넣고 "내가 당신을 쓰러뜨릴 수 있게 해 주면, 아니면 지금 당장 당신을 끌고 나가고 당신을 노출시킬 것입니다." # AI Tags
