bno_random_0037.title: "야생물 이 있는 곳" # AI Tags
bno_random_0037.desc: "넌 블랙 을 안먹는 순간도 없었어 적어도 지금은 아니죠. 네 선호도가 네 흑인 궁중들 사이에서 공개적으로 공유되었기 때문이죠. 널 공개적으로 공유하고 열차를 타고 널 지나가며 네 몸과 왕국을 좋아하게 해줬어 결국, 그들은 당신이 그들을 위해 필요한 모든 용서를 부여할 것이라는 것을 알고 있었다. 보이우리즘도 예외는 아니었습니다. 사실, 그것은 당신의 좋아하는 과거 중 하나였습니다.\n\n"젠장,젠장... 그래, 그래! 저쪽 [target1.GetFirstName] 이봐요! 젠장 - 바로 거기에!" 당신은 크게 비명을 지르고, 야생의 공기가 당신의 외침을 감추기 위해 거의하지 않습니다, 네 헐벗은 얼굴 뒤에 [target1.GetFirstName] 네 다리 사이에 묻히고, 네 방위없는 거미를 뜯어내고, [target2.GetFirstName] 네 얼굴이 자유로이 지배하고, 현재 네 머리카락을 묶고, 네 턱은 이미 멍청한 방울으로 덮여 있어, 통제할 수 없을 정도로, 그의 두꺼운 좆의 막대기가 네 멀리 떨어져 있어. 디코르디아의 정원의 황금 사과처럼, 당신은 그것을 쳐다보며, 거대 이 고 며, SS는 [target1.GetFirstName].\n\n"이 돼지는 닥칠 수 없어[target2.GetFirstName]한 손으로 엉덩이를 들어올리고 얼굴에 비웃는 똥을 뱉는 동안 열렬히 그를 초대하고, 당신은 당신의 입을 열고, 당신의 혀를 꺼내서 당신의 입술로 그를 잡으려고 노력합니다. 너무 절박합니다. 그는 자신의 톱을 혀에 긁어보고, 그의 립을 맛볼 수 있게 해줍니다."\n\n"네, 이제 내가 왜 널 여기 데려왔는지 알잖아[target1.GetFirstName] 웃고, 엉덩이를 치고, 고기가 흔들리는 것을 보고, 당신의 주스가 그의 똥을 덮고 있는 동안. "어젠장. 그 석탄을 잡아 [target2.GetFirstName] 당신의 똥을 벌인 남자가 말합니다. 그 똥이 당신 안에 있는 동안 치아를 긁어내고, 오르가즘의 반쯤에서 빠져나가고, 당신의 좆이 그의 씨앗을 뱉어내는 것을 보고 루티 폭포 뒷바닥에 박을 때, 그는 당신 앞에 있는 남자가 바구니에 몸을 숙이고 탄소를 낚아내고 친구에게 던지는 것을 보고 있습니다. "[bno_bbc|E]... 창녀... [target1.GetFirstName] 돌이 엉덩이를 긁는 것을 느낄 때 미소를 짓고 눈을 넓히고 머리를 돌리고 트랜스를 깨고 [target2.GetFirstName] 좆이야" # AI Tags
